INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (69, 444107, 'PAW Patrol: Pups And The Pirate Treasure', 'movie', 'Cap''n Turbot accidentally stumbles into a secret cavern that was once a pirate''s hideout. When the PAW Patrol rescues him, they find an incomplete treasure map. The adventure is on as the pups follow clues to find the missing map pieces, and eventually to a sunken pirate treasure!', '/nuee8aZ909iRHGPMGd1HSwBzqZ1.jpg', NULL, '2014-01-01', '7.0', '[16, 12, 10751]', '[]', NULL, '2025-10-17 22:52:59.212348', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (70, 1223524, 'PAW Patrol : Big Truck Pups', 'movie', 'Get ready for BIG adventure, BIG rescues, and BIG trucks! Launching from their new Truck Stop HQ, Ryder, the pups, and their new pup-friend Al, will take their brand-new Big Trucks out on the road to save the day. The pups team up with Al to save the Adventure Bay Bridge and also stop a flood, plus so much more! Bigger rescues call for bigger rides and a new friend!', '/bzKG9pJ7BFJvEpRFGvvbIY2FmmX.jpg', '/rFp3sYM77xl7Ihq6W5QmxHsxezn.jpg', '2022-12-06', '7.5', '[16]', '[]', NULL, '2025-10-17 22:52:59.461192', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (72, 420821, 'Chip ''n Dale: Rescue Rangers', 'movie', 'Decades since their successful television series was canceled, Chip has succumbed to a life of suburban domesticity as an insurance salesman. Dale, meanwhile, has had CGI surgery and works the nostalgia convention circuit, desperate to relive his glory days. When a former cast mate mysteriously disappears, Chip and Dale must repair their broken friendship and take on their Rescue Rangers detective personas once again to save their friend’s life.', '/7UGmn8TyWPPzkjhLUW58cOUHjPS.jpg', '/qK7Ssnrfvrt65F66A1thvehfQg2.jpg', '2022-05-20', '7.0', '[16, 10751, 35, 12, 9648]', '["disney_plus"]', NULL, '2025-11-01 15:54:53.977795', NULL, NULL, NULL, false, NULL, NULL);
