INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (76, 53751, 'Corn Chips', 'movie', 'Donald is shoveling the snow off his walk; Chip ''n'' Dale are shoveling their branch. Donald tricks them into shoveling his walk. Angered, they sneak into his house, where he''s getting ready to make popcorn. They''ve never seen this before, but they love it. They stow away in the box, then make off with the bowl of popped corn.', '/z8yT7eIFfYvD9EnjB6qWx5NXOGY.jpg', '/n3TgBylA6zjAYFN5PfxpGYNDbMM.jpg', '1951-03-23', '7.2', '[16, 35]', '["disney_plus"]', NULL, '2025-11-01 15:55:08.21478', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (77, 49554, 'Chip ''n'' Dale: Here Comes Trouble', 'movie', 'The most mischievous characters to ever come out of Disney studios, Chip ''N'' Dale are cute, cuddly and always in the centre of trouble. Here is a special collection of their Adventures that will have you and your family laughing again and again. It''s double trouble in ''Chip ''N'' Dale Go Nuts'' when Donald tries to chop down their house for firewood, along with their supply of nuts. Then Chip ''N'' Dale make themselves at home in Donald''s train set in ''Out Of Scale''. It''s romantic mayhem when Chip ''N'' Dale like the same girl in ''Two Chips And A Miss''. In ''Food For Feudin", Pluto wants to hide his bones in the same tree where Chip ''N'' Dale store their acorns.', '/3fMKujwp38YN7nX94HHqWjekQCf.jpg', '/5ezteHcqOkZOOQgu2j9h68wIoq4.jpg', '2004-08-25', '6.9', '[16, 10751, 12, 35]', '[]', NULL, '2025-11-01 15:55:13.962595', NULL, NULL, NULL, false, NULL, NULL);
