INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (80, 398284, 'Chip ''n'' Dale''s Rescue Rangers to the Rescue', 'movie', 'Chip and Dale, Disney''s favorite chipmunk team, form their own protection agency for their fellow animals, where they seek to help the helpless and protect those in peril from those who would exploit them.', '/mG7WobVyjbZy33rnhIeiaFmAqQt.jpg', '/3wXJqoCgFTzWM3rcUmkWbzjwvFK.jpg', '1989-09-30', '7.471', '[16]', '[]', NULL, '2025-11-01 15:55:14.738488', NULL, NULL, NULL, false, NULL, NULL);
