INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (89, 1369406, 'Ice Age', 'movie', ''' You should have thrown the hand-grenade.'' '' I''ve still got it!''  An unexpected stranger arrives at the old people''s home in Norway where a famous writer is kept in confinement after the war. Should he be brought to trial for collaborating with the Nazis? Or will the young partisan carry through his original plan to kill him?', '/hq47jZjuQUIWcveiw0uErogBOcB.jpg', NULL, '1978-05-17', '0.0', '[]', '[]', NULL, '2025-11-07 18:58:56.998842', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (90, 385048, 'Ice Age', 'movie', 'In the tenth year of marriage, Babak and Manizheh face the biggest challenge of their life. Financial problems and difficult social situation cause Babak to work very hard and this leads to a deep gap between him and his wife, in a way that Manizheh starts a new relation, the relation which leads her to addiction and immorality. On the verge of her complete collapse, she wakes up to the truth that she has lost her life.', '/lQ7FbG2UwmrSHrEiIKkwgec4b2y.jpg', NULL, '2015-06-24', '6.0', '[18]', '[]', NULL, '2025-11-07 18:58:57.262797', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (92, 1081128, 'Ice Aged', 'movie', 'Bringing humour, grit, and pure joy to the rink, “Ice Aged” follows six senior men and women from around the world as they pursue their childhood dreams of competitive figure skating. From local ice rinks to the grand stage at the World Hobby Figure Skating Championships in Bavaria, their inspiring journey defies age and expectations. Beautifully filmed over nearly three years, the cameras capture every tear, cheer, and broken bone as these skaters pursue their dreams. Not even a global pandemic can stop them from pushing forward in this fairytale on ice.', '/3k1a4z301DYvoiRH0iI7W6kITB.jpg', '/wIaVZ73DGhFDNdQfAwgxOEhUcM5.jpg', '2025-04-10', '6.0', '[99]', '[]', NULL, '2025-11-07 18:58:57.788025', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (93, 57800, 'Ice Age: Continental Drift', 'movie', 'Manny, Diego, and Sid embark upon another adventure after their continent is set adrift. Using an iceberg as a ship, they encounter sea creatures and battle pirates as they explore a new world.', '/dfp1BZF7FxbBUyzHvMOI9t8NWDD.jpg', '/kyTlMMVWo1GffYoQctZwLqJcwaj.jpg', '2012-06-27', '6.388', '[16, 35, 12, 10751]', '["disney_plus"]', NULL, '2025-11-07 18:58:58.047838', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (94, 278154, 'Ice Age: Collision Course', 'movie', 'Set after the events of Continental Drift, Scrat''s epic pursuit of his elusive acorn catapults him outside of Earth, where he accidentally sets off a series of cosmic events that transform and threaten the planet. To save themselves from peril, Manny, Sid, Diego, and the rest of the herd leave their home and embark on a quest full of thrills and spills, highs and lows, laughter and adventure while traveling to exotic new lands and locations.', '/dWyaaP1dmW5peBvgiVaugdRuyYD.jpg', '/lyt9DYP0Suy1j8XnjJl0saVOs8K.jpg', '2016-06-23', '6.115', '[12, 16, 10751, 35, 878]', '["disney_plus", "hulu"]', NULL, '2025-11-07 18:58:58.311933', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (95, 8355, 'Ice Age: Dawn of the Dinosaurs', 'movie', 'Times are changing for Manny the moody mammoth, Sid the motor mouthed sloth and Diego the crafty saber-toothed tiger. Life heats up for our heroes when they meet some new and none-too-friendly neighbors – the mighty dinosaurs.', '/cXOLaxcNjNAYmEx1trZxOTKhK3Q.jpg', '/o0zPARvs47f0UhAJuUqdQsyQaji.jpg', '2009-06-26', '6.8', '[16, 35, 10751, 12]', '["disney_plus", "hulu"]', NULL, '2025-11-07 18:58:58.571832', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (96, 343135, 'The New Ice Age', 'movie', 'The final part of Keuken''s ''North-South'' trilogy, which examines the complex and unequal relationships between industrialized and developing nations. The film draws a sharp parallel between two distinct groups of people: impoverished Peruvians living in the cheerless slums outside Lima, and a family of young Dutch factory workers, including three sisters and a brother, who lead monotonous lives.', NULL, NULL, '1974-01-01', '0.0', '[99]', '[]', NULL, '2025-11-07 18:58:58.835767', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (79, 82707, 'Chip ''n Dale''s Nutty Tales', 'tv', 'Things are about to get a little nutty as Chip and Dale set off on adventures around Hot Dog Hills in these eight exciting shorts! The dynamic duo can’t seem to stay away from trouble as they bake up BIG muffin mayhem, set sail on a fishing trip and create a mail mishap along with other misadventures. But no matter where they end up, Chip and Dale will do whatever it takes to help their Roadster Racing friends and have a laugh along the way!', '/s6uH3IONWeYe0JEaHMIAF7HbUVj.jpg', '/hELYTw0NbjGWIelNWixGEZDKjsT.jpg', '2017-11-13', '6.455', '[16]', '["disney_plus"]', NULL, '2025-11-01 15:55:14.479742', NULL, NULL, NULL, false, NULL, 'chip-n-dales-nutty-tales');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (81, 135456, 'Shake Your Tail with Chip ''N Dale', 'tv', 'Watch Chip and Dale shake their tails while they travel to different countries.', '/htYDLCh8F4LlMn0CeKoDXRJg7iS.jpg', '/otLRfzJFp37XLfSeGJ7b50hmVkN.jpg', '2021-06-07', '0.0', '[16, 10762]', '[]', NULL, '2025-11-01 15:55:15.008289', NULL, NULL, NULL, false, NULL, 'shake-your-tail-with-chip-n-dale');
