INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (103, 516541, 'Mammoths: Giants of the Ice Age', 'movie', 'Follow one mammoth expert as he traces the legendary giants from Africa to the Yukon.', '/dZw4toEkmMYykYfkIK6jmzGqGJc.jpg', '/3NHTiarIA9kgV04qn9vTQxgSaat.jpg', '2014-12-25', '6.0', '[99]', '[]', NULL, '2025-11-07 18:59:00.676704', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (105, 297544, 'Age of Ice', 'movie', 'Massive earthquakes open the Arabian tectonic plate, resulting in unstable weather and freezing temperatures that will be unsurvivable by nightfall. Attempting to reach safety, a vacationing family in Egypt must battle the rapidly cooling temperatures that usher in a new Ice Age, covering the Sphinx, Pyramids, and Sahara Desert with mountains of snow.', '/ajWTTgzLImSumz0U0G6cOZMsE1v.jpg', '/yYRnKegwbSZmszbGOxlRhLNTzWC.jpg', '2014-12-09', '3.9', '[12, 878]', '[]', NULL, '2025-11-07 18:59:01.203729', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (107, 576435, 'A New Ice Age', 'movie', 'Near a windy, misty beach, Eric and David, two brothers in their twenties run a camping site. It covers several hectares on an eroded dune facing the sea. It is the end of the season, the site is empty, the days follow and all seem the same. Then one day Eric disappears. David goes looking for him…', '/eWoPtQCiTSxCYvNcnbnmOhwxCGe.jpg', NULL, '2010-02-24', '0.0', '[]', '[]', NULL, '2025-11-07 18:59:01.727428', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (97, 251202, 'The Ice Age', 'tv', 'The action takes place in Russia in the mid-90s and tells about the dramatic twists and turns of the personal and professional life of Igor Klepko, an employee of the special department of the criminal investigation department for combating organized crime and banditry, who has every chance to become a new national hero.', '/idfgwUJflPSj2wNAFtVWR1fnVPh.jpg', NULL, '2002-01-01', '0.0', '[18]', '[]', NULL, '2025-11-07 18:58:59.095583', NULL, NULL, NULL, false, NULL, 'the-ice-age');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (99, 158307, 'Ice Age: Scrat Tales', 'tv', 'Scrat experiences the ups and downs of fatherhood, as he and the adorable, mischievous Baby Scrat, alternately bond with each other and battle for ownership of the highly treasured Acorn.', '/mTfYwY7DELH08SeO8LyUMe9Tvfr.jpg', '/d6bd55iIpEd5iuTSxJNvW4ATdwq.jpg', '2022-04-13', '7.327', '[16, 10751, 35, 10762]', '["disney_plus"]', NULL, '2025-11-07 18:58:59.621839', NULL, NULL, NULL, false, NULL, 'ice-age-scrat-tales');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (91, 950, 'Ice Age: The Meltdown', 'movie', 'Diego, Manny and Sid return in this sequel to the hit animated movie Ice Age. This time around, the deep freeze is over, and the ice-covered earth is starting to melt, which will destroy the trio''s cherished valley. The impending disaster prompts them to reunite and warn all the other beasts about the desperate situation.', '/zDduhCHasKQ9YOTvlOreHem7Wbi.jpg', '/o1jr0UqVjxIZ1JnFzuVLN4ulWey.jpg', '2006-03-29', '6.716', '[16, 10751, 35, 12]', '["disney_plus", "hulu"]', NULL, '2025-11-07 18:58:57.523835', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (113, 33875, 'Pokémon Heroes', 'movie', 'Ash, Pikachu and the gang try and stop a pair of thieves hiding out in the canals and alleyways of Altomare, the age-old water capital. Joining the adventure are two new legendary Pokémon, a pair of siblings named Latias and Latios, who serve as peacekeepers and protectors of the Soul Dew — a priceless treasure with a mysterious power.', '/eySv5rdYLW1k6LxepxCNl8ND26R.jpg', '/6nfEmbfWMuMBenYMOY6Vdho3Ycg.jpg', '2002-07-13', '6.6', '[16, 12, 28, 14, 878]', '[]', NULL, '2025-11-07 19:44:07.137309', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (111, 12600, 'Pokémon 4Ever', 'movie', 'In order to escape a greedy Pokémon hunter, Celebi must use the last of its energy to travel through time to the present day. Celebi brings along Sammy, a boy who had been trying to protect it. Along with Ash, Pikachu, and the rest of the gang, Sammy and Celebi must encounter an enemy far more advanced than the hunter, with the fate of the forest hanging in the balance.', '/thz83PS9twtVBEEAM59J1bh75nU.jpg', '/lnwNzJdU4gMlgoQlaT8HgSI2OpD.jpg', '2001-07-06', '6.467', '[12, 14, 16, 878, 10751]', '[]', NULL, '2025-11-07 19:44:06.615171', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (110, 115223, 'Pokémon the Movie: Black - Victini and Reshiram', 'movie', 'The Kingdom of the People of the Earth once ruled over the land, but now all that remains is the Sword of the Earth. in the city of Eindoak. Satoshi, Iris, and Dent arrive in Eindoak during a harvest festival''s Pokémon Tournament and meet the legendary Pokémon Victini who wishes to share its powers of victory to someone. Elsewhere in the city, a descendant of the People of the Earth named Dred Grangil has arrived who seeks to revive the kingdom''s power with the Sword of the Earth, bringing them back into power over the land, and Satoshi and his friends must stop him before he destroys the land along with Victini.', '/SuIAXmxlbImWHobCkCWCHAeg03.jpg', '/2cpTYNwiC7RH5pLsZs7HIL6dBWB.jpg', '2011-07-16', '6.5', '[16, 10751, 12, 18, 14]', '[]', NULL, '2025-11-07 19:44:06.331881', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (109, 39057, 'Pokémon: Arceus and the Jewel of Life', 'movie', 'When the creator of the world, Arceus, comes to pass judgement on humanity for the theft of the legendary Jewel of Life, Ash and his friends are sent back in time to possibly reverse the events that led to Arceus'' vendetta.', '/tpqguVMKyPbINe0GYmMwduoaUar.jpg', '/1WygXLVPO4wNYm6WUgUi7PNAvkU.jpg', '2009-07-18', '7.079', '[10751, 16, 12, 14]', '["hulu"]', NULL, '2025-11-07 19:44:06.065579', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (27, 10991, 'Pokémon 3: The Movie', 'movie', 'When the sadness of her father''s disappearance gets to Molly Hale, she unknowingly uses the Unown to create her own dream world along with Entei, who she believes to be her father. When Entei kidnaps Ash''s mother, Ash — alongside Misty and Brock — invade the mansion looking for his mom and trying to stop the mysteries of Molly''s Dream World and Entei!', '/rf1ptotD12w8NYzaKXgrjKUl4d5.jpg', '/dLGQo5Xq6H18vPx00Czot8VHi3K.jpg', '2000-07-08', '6.507', '[12, 14, 16, 28, 10751]', '[]', NULL, '2025-10-06 21:46:28.764285', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (108, 662708, 'Pokémon the Movie: Secrets of the Jungle', 'movie', 'In the Forest of Okoya, Koko is a feral child who has been raised as a Pokémon by the Mythical Pokémon Zarude. Koko has grown up never doubting that he is a Pokémon even though he can''t really use any sort of moves. Ash Ketchum and Pikachu meet Koko and help him protect the Great Tree from the crooked scientist Dr. Zed.', '/9Ow7PJcAHMMxgSIjCW6RnRqE9OA.jpg', '/4KpNHvQIjyg1YFovRAoUXoFrGnR.jpg', '2020-12-25', '7.2', '[16, 12, 10751, 14]', '["netflix"]', NULL, '2025-11-07 19:44:05.710623', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (98, 774825, 'The Ice Age Adventures of Buck Wild', 'movie', 'The fearless one-eyed weasel Buck teams up with mischievous possum brothers Crash & Eddie as they head off on a new adventure into Buck''s home: The Dinosaur World.', '/zzXFM4FKDG7l1ufrAkwQYv2xvnh.jpg', '/qw02SUqrrdTjAOPCFJBPyKaVf4z.jpg', '2022-01-28', '6.589', '[16, 35, 10751, 12]', '["disney_plus"]', NULL, '2025-11-07 18:58:59.36165', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (100, 639547, 'What Killed the Ice Age Giants?', 'movie', 'Scientists speculate why the end of the last Ice Age caused the extinction of some of Earth''s largest animals.', '/rBMxcPP0Q8dT3v3iCR78EaUN7lt.jpg', '/900sJuE7q327nFCwXJbR4YJaDht.jpg', '2019-10-04', '6.9', '[99]', '[]', NULL, '2025-11-07 18:58:59.888978', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (102, 59722, '2012: Ice Age', 'movie', 'A volcanic eruption in Iceland sends a glacier towards North America, causing everything in it''s path to freeze. A family man struggles to escape the onslaught of the coming ice age.', '/yzbqGfYDxE6biVDGs6G9GEcLNbD.jpg', '/hpRHQ8ku4l1Aw6M2XOKBf5OyyYD.jpg', '2011-06-27', '4.5', '[28, 12, 878]', '[]', NULL, '2025-11-07 18:59:00.415908', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (104, 1384758, 'Ice Age: Boiling Point', 'movie', 'A dinosaur-and-lava-filled madcap adventure that takes Manny, Sid, Diego, Ellie, Scrat and the rest of the herd to visit never-before-seen corners of the treacherous Lost World.', '/yyzETVERFGsf0ykL0vxwzpdIERK.jpg', '/u3E7FHkb6ROuD3uS5IDzsdq2uFI.jpg', '2027-02-04', '0.0', '[16, 35, 10751, 12]', '[]', NULL, '2025-11-07 18:59:00.942752', NULL, NULL, NULL, false, NULL, NULL);
