INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (32, 45140, 'Teen Titans Go!', 'tv', 'Robin, Starfire, Raven, Beast Boy and Cyborg return in all-new, comedic adventures. They may be super heroes who save the world every day ... but somebody still has to do the laundry!', '/kPKAigYUlWRpnfo4Ptiwlz4FWXU.jpg', '/bIHCUqaapZdRjd2kzSDiwzYyrpC.jpg', '2013-04-23', '6.5', '[16, 10759, 35, 10751, 10765]', '["hulu"]', '{"Hulu": "https://www.hulu.com/series/teen-titans-go-4792c643-984d-44a7-ba4a-413e3ecbcac0"}', '2025-10-06 21:48:21.741163', 9, 436, NULL, false, NULL, 'teen-titans-go');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (51, 57532, 'PAW Patrol', 'tv', 'Marshall, Rocky, Rubble, Zuma and Skye are doing their best to protect the people of their town. Led by Ryder, a tech-savvy 10-year-old boy, each of them is equipped with special equipment and together they help anyone who finds themselves in trouble. No task is too big for them and no puppy is too small.', '/9S65uEjDqepU7d71CNmxIBHHdo.jpg', '/7OrV2aAH5Yp7hA9zCCvUloLvZtl.jpg', '2013-08-12', '7.0', '["Animation", "Kids"]', '["netflix", "prime_video"]', NULL, '2025-10-17 22:52:54.714262', 12, 522, 6.997, true, '2025-11-17 21:22:28.201922', 'paw-patrol');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (44, 227413, 'Po-Po-Poker', 'tv', 'The show features a poker game with an endless array of entertainment. Each episode invites different celebrities from the entertainment industry to play poker and chat about recent events and interesting stories within the industry. Though the game doesn''t involve real money, losing heavily will result in a larger punishment. With each hand of poker, the show offers a glimpse into the less-known aspects of the entertainment industry.', '/uGeL6AsY2fZUi6MHw12mNkqcTR9.jpg', '/1N9atIGzjp50q580qpqnsEt0xdZ.jpg', '2022-06-25', '0.0', '[10764]', '[]', NULL, '2025-10-06 21:48:38.959585', NULL, NULL, NULL, false, NULL, 'po-po-poker');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (60, 921042, 'PAW Patrol. Mission Xmas', 'movie', 'Adventure Bay''s main rival wants to ruin Christmas. Mayor Harold Humdinger covets an undeserved gift and ruins Santa''s plans. The Brave Puppies, along with Robops, must outrun Humdinger, help Santa deliver all the presents on time, and save the holiday. At this time, Santiago and his team are waiting for an exciting adventure to save Christmas! On the island of Encanto, the holiday is under threat: the treacherous Enrique sends a snowstorm to Santa and takes all the gifts for himself. But the wit and courage of Santiago and his team help to overcome all the traps of Enrique.', '/hqR2f2FgOdblavppvwQsWEIBZpm.jpg', '/lAJm9SFh62Q37QCfewBtqg8ePnD.jpg', '2022-01-02', '10.0', '[16]', '[]', NULL, '2025-10-17 22:52:56.975487', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (66, 651407, 'PAW Patrol: Pups Save Puplantis', 'movie', 'A six episode compilation of Puplantis (Sea Patrol) themed episodes from seasons 4 & 5.  Dive deep into six  epic underwater missions with the PAW Patrol, featuring two double-length episodes! When the Mer-pups'' magical city of Puplantis begins to collapse, it''s up to the Sea Patrol to find out why before it''s too late. Then see how the pups stop Sid the Pirate and his first mate Arrby from stealing the Sea Patroller, and save a giant sea slug''s home!  Includes:INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (83, 43411, 'Chip ''n Dale: Trouble in a Tree', 'movie', 'The most mischievous characters to ever come out of Disney studios, Chip ‘N’ Dale are cute, cuddly and always in the centre of trouble. Here is a special collection of their adventures that will have you and your family laughing again and again. Donald Duck goes nuts when he finds himself "Out On A Limb" as he tries to prune Chip ‘N’ Dale’s tree home! In "Corn Chips", Donald convinces them to shovel his snowy sidewalk but ends up shovelling popcorn! Next, it’s Christmas and Chip ‘N’ Dale fight with Donald over the goodies under his tree in "Toy Tinkers". Guess who invite themselves over for Donald’s pancakes in "Three For Breakfast"?', '/b8jrLAX94qf4ozpLG9P2j2FV1I6.jpg', '/81mJNBNkYkqdB2TtaNQ9YUM8dSh.jpg', '2005-03-14', '7.6', '[16, 10751]', '[]', NULL, '2025-11-01 15:55:15.528038', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (112, 436931, 'Pokémon the Movie: I Choose You!', 'movie', 'Ash Ketchum wakes up late one morning after having broken his alarm clock in his sleep. He eventually makes it to Professor Oak''s lab, but is told that the three starter List of Pokémon (Bulbasaur, Squirtle, and Charmander) have already been taken by Trainers who were on time. However, Oak reveals that he has one more Pokémon, an Electric-type named Pikachu. Despite its volatile and feisty personality, as well as its refusal to get inside a Poké Ball, Ash happily takes Pikachu for his journey.', '/b4U689nUPUtER5Qh1MNlLRPeh8q.jpg', '/dyDxxLRTwqGFNOCtLbpxD1QLlfJ.jpg', '2017-07-15', '7.059', '[10751, 16, 12, 14]', '[]', NULL, '2025-11-07 19:44:06.884137', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (117, 624620, 'PAW Patrol: Ready, Race, Rescue!', 'movie', 'It’s the Adventure Bay 500! The pups have built an awesome race track and are ready to be the pit crew for their race hero, The Whoosh! But when the legendary racer is unable to drive in the championship race, he calls on his biggest fan-pup Marshall to take the wheel and race in his place! Marshall has to overcome his lack of confidence and his dastardly competition, The Cheetah, to fulfill his dream of becoming the fastest race-pup ever!', '/nnnsxea1j6hfoE0q1WY0V9yRBPY.jpg', '/9Kv8JLhvz6iQeqcxIut0BMEvIPz.jpg', '2019-08-02', '7.079', '[16, 10751]', '["prime_video"]', NULL, '2025-11-17 17:53:10.977357', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (1, 13869, 'Bluey', 'tv', 'At Melbourne''s Russell Street Police Headquarters, Sgt. "Bluey" Hills, unable to work within the existing police squads, oversees Department B. They''re assigned cases other departments could not readily solve by conventional means, with Hills applying his unconventional methods to bring about their resolution. Bluey''s investigations are supported by newly assigned Gary Dawson, long-time cohort Monica Rourke, and undercover officer Reg Truscott, who spends his time ostensibly working as a small-time burglar, and supplying Bluey with information on the activities of local criminals.', '/a48KQ6a1zLLZW7tfjfOdW8bVOo6.jpg', NULL, '1976-08-02', '6.0', '[18, 80]', '[]', '{}', '2025-10-06 20:23:57.77083', NULL, NULL, NULL, false, NULL, 'bluey');
