INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (45, 12708, 'Poker Royale', 'tv', 'Poker Royale was a television series on the Game Show Network, which featured No Limit Texas hold ''em Poker. The first series began on December 7, 2004. The seventh and final series, Poker Royale: Battle of the Ages, began airing on November 4, 2005. The series host at its conclusion was John Ahlers, with commentary by Robert Williamson III and sideline reporting by Lisa Dergan.', NULL, NULL, '2004-12-07', '0.0', '[]', '[]', NULL, '2025-10-06 21:48:39.349526', NULL, NULL, NULL, false, NULL, 'poker-royale');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (47, 14399, 'Food Poker', 'tv', 'Food Poker is a BBC tea-time television programme which fuses traditional culinary skills with poker. It is presented by Matt Allwright and each episode features four chefs. It was first broadcast on BBC Two in 2007.', NULL, NULL, '2007-10-29', '0.0', '[]', '[]', NULL, '2025-10-06 21:48:39.870221', NULL, NULL, NULL, false, NULL, 'food-poker');
