INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (78, 96715, 'Chip ''n'' Dale: Park Life', 'tv', 'A non-verbal, classic style comedy, following the ups and downs of the much-loved chipmunk troublemakers living life in the big city.', '/3JPFgEWoiV6RAzD5o5why4xISDw.jpg', '/hERNDOSh3tTWGZK6rD7FN01SKnK.jpg', '2021-07-28', '6.4', '[16, 10762, 35, 10759]', '["disney_plus"]', NULL, '2025-11-01 15:55:14.221061', 2, 30, NULL, false, NULL, 'chip-n-dale-park-life');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (115, 387, 'SpongeBob SquarePants', 'tv', 'Deep down in the Pacific Ocean in the subterranean city of Bikini Bottom lives a square yellow sponge named SpongeBob SquarePants. SpongeBob lives in a pineapple with his pet snail, Gary, loves his job as a fry cook at the Krusty Krab, and has a knack for getting into all kinds of trouble without really trying. When he''s not getting on the nerves of his cranky next door neighbor Squidward, SpongeBob can usually be found smack in the middle of all sorts of strange situations with his best buddy, the simple yet lovable starfish, Patrick, or his thrill-seeking surfer-girl squirrel pal, Sandy Cheeks.', '/5h0EU2lqBb03dp5vtRuUHJwqzem.jpg', '/61u5BENargOxT5FtHPZDOlEqtHB.jpg', '1999-05-01', '7.695', '[16, 35, 10751]', '["prime_video"]', NULL, '2025-11-08 22:49:44.240368', 17, 634, NULL, false, NULL, 'spongebob-squarepants');
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (118, 920, 'Cars', 'movie', 'Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town''s offbeat characters.', '/2Touk3m5gzsqr1VsvxypdyHY5ci.jpg', '/sd4xN5xi8tKRPrJOWwNiZEile7f.jpg', '2006-06-08', '7.013', '[16, 12, 35, 10751]', '["disney_plus"]', NULL, '2025-11-18 19:55:58.812822', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (119, 46879, 'Mickey Mouse', 'tv', 'In this series of cartoon shorts, Mickey Mouse finds himself in silly situations all around the world! From New York to Paris to Tokyo, Mickey experiences new adventures with his friends!', '/aAJ5T2Ab28vbbP9s6wWqdtK3arQ.jpg', '/qqaCwVzDmocRBI5Kl4RGgfwabn1.jpg', '2013-06-28', '7.605', '[16, 10762, 35, 18]', '["disney_plus"]', NULL, '2025-11-18 19:56:59.592452', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (121, 934323, 'Mickey: The Story of a Mouse', 'movie', 'Mickey Mouse is one of the most enduring symbols in our history. Those three simple circles take on meaning for virtually everyone on the planet. So ubiquitous in our lives that he can seem invisible, Mickey is something we all share, with unique memories and feelings. Over the course of his nearly century-long history, Mickey functions like a mirror, reflecting our personal and cultural values back at us. "Mickey: The Story of a Mouse" explores Mickey''s significance, getting to the core of what Mickey''s cultural impact says about each of us and about our world.', '/cYHE9FdgXBFUWvWaIKsDHODDOTS.jpg', '/sTQw7EpiMtyFOopwTLV7DjsNbOx.jpg', '2022-03-19', '7.04', '[99]', '["disney_plus"]', NULL, '2025-11-18 19:57:00.623115', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (123, 2208, 'The Mickey Mouse Club', 'tv', 'A variety show featuring a cast of child performers.', '/rXC5rbj05g56U93LQsllj3ycF8k.jpg', NULL, '1955-10-03', '6.3', '[10762]', '["disney_plus"]', NULL, '2025-11-18 19:57:01.7568', NULL, NULL, NULL, false, NULL, NULL);
INSERT INTO public.titles (id, tmdb_id, title, media_type, overview, poster_path, backdrop_path, release_date, rating, genres, providers, deep_links, last_synced, number_of_seasons, number_of_episodes, vote_average, fandom_scraped, fandom_scrape_date, wiki_slug) VALUES (124, 109930, 'The Wonderful World of Mickey Mouse', 'tv', 'It''s nothing but fun and excitement for Mickey and his best pals – Minnie, Donald, Daisy, Goofy and Pluto - as they embark on their greatest adventures yet, navigating the curveballs of a wild and zany world where the magic of Disney makes the impossible possible.', '/8F1V4ve64YPmyRZZ5u0jh7KCIID.jpg', '/Eto7g02aDIbK0P5a1TTyKqbVSm.jpg', '2020-11-18', '7.5', '[16, 10751, 10762]', '["disney_plus"]', NULL, '2025-11-18 19:57:02.100321', NULL, NULL, NULL, false, NULL, NULL);
