INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (8, 51, NULL, 1, 1, 'Pups and the Kitty-tastrophe', 'A kitten named Precious is floating out to sea, and the PAW Patrol must rescue her, but that''s not all. The PAW Patrol must also act fast to find her owner before the mischievous kitten gets into big trouble.', NULL, '/hpEKz8Fjm808jGcm56jLnBMo5yu.jpg', '2013-08-12', '2025-11-17 21:21:45.40683', '2025-11-17 21:21:45.406833');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (9, 51, NULL, 1, 2, 'Pups Save a Train', 'The train that Katie and Cali are on is stuck on a bridge because of a rock slide. The PAW Patrol must act fast since the broken bridge beam can''t hold the train for long!', NULL, '/et3nQjdSZUInduiCcmpB8bGEV2O.jpg', '2013-08-12', '2025-11-17 21:21:45.406834', '2025-11-17 21:21:45.406834');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (10, 51, NULL, 1, 3, 'Pup Pup Boogie', 'A train car falls off the tracks and also breaks some rails. A train is coming later with important packages in it, with the all new Pup Pup Boogie 2.0 dance game. The PAW Patrol tries to fix the tracks, but how will they fix the tracks when Rubble sprains his paw and can''t work? Can Chase save the day?', NULL, '/4bVBy1usJ4ixxQ42FSndW7KvEk1.jpg', '2013-08-19', '2025-11-17 21:21:45.406834', '2025-11-17 21:21:45.406837');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (11, 51, NULL, 1, 4, 'Pups in a Fog', 'While the pups are having a sleepover, the Lighthouse light runs out of power. Cap''n Turbot, the one who monitors the Lighthouse light, is out at sea.', NULL, '/9ctJbBhVp95pGMBXEBOeoVHvLn9.jpg', '2013-08-19', '2025-11-17 21:21:45.406838', '2025-11-17 21:21:45.406838');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (12, 51, NULL, 1, 5, 'Pups Save the Sea Turtles', 'Baby sea turtles were hatching at the other side of the road near the beach. They can''t get to the beach without crossing the street, there are cars, skateboarders, scooters and all the hungry naughty seagulls around, not to mention Alex''s rambunctious antics.', NULL, '/lgc36HJ3XfvbAnS0471t3hfbkjo.jpg', '2013-08-20', '2025-11-17 21:21:45.406839', '2025-11-17 21:21:45.406839');
