INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (530, 2, 1583478, 1, 1, 'The Magic Xylophone', 'As Bluey and Bingo squabble over their magic xylophone (that has the power to freeze Dad in space and time) Dad seizes control and freezes Bluey, leaving Bingo as her only hope.', 7, '/4vrYTRSUjQ6i9BuyBwAyFHBWfO6.jpg', '2018-10-01', '2025-11-18 17:57:03.82879', '2025-11-18 17:57:03.828795');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (531, 2, 1583479, 1, 2, 'Hospital', 'Doctor Bluey is needed when Dad gets a very curious x-ray from Nurse Bingo. It seems he has a cat in his tummy, leaving Bluey no choice but to operate immediately!', 7, '/8YoNM0dgSw6gqUtOoijsw1VyQi8.jpg', '2018-10-02', '2025-11-18 17:57:03.828796', '2025-11-18 17:57:03.828796');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (532, 2, 1583481, 1, 3, 'Keepy Uppy', 'Bluey, Bingo and Mum are enjoying playing Keepy-Uppy around the house with their last balloon, when Dad joins in and the game becomes the ultimate test of skill.', 7, '/rju1CL5ae40DmHSawZAr7GvVHKs.jpg', '2018-10-03', '2025-11-18 17:57:03.828797', '2025-11-18 17:57:03.828799');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (533, 2, 1583484, 1, 4, 'Daddy Robot', 'Bluey and Bingo don''t want to tidy the playroom, so they get Daddy Robot to do it for them. But when Bluey takes things too far, Daddy Robot malfunctions with disastrous results.', 7, '/NytBQymaDFBK1NYFHeW7iThJ9w.jpg', '2018-10-04', '2025-11-18 17:57:03.828801', '2025-11-18 17:57:03.828801');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (534, 2, 1583486, 1, 5, 'Shadowlands', 'On a picnic in the park, Bluey and her friends play Shadowlands. But when Coco keeps taking shortcuts, Bluey has to show her that following the rules can make the game more fun.', 7, '/dJhXDWIufAgpx5I7mzZ38dY3hQU.jpg', '2018-10-05', '2025-11-18 17:57:03.828802', '2025-11-18 17:57:03.828802');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (535, 2, 1593872, 1, 6, 'The Weekend', 'At the weekend, Bluey and Bingo are playing in the garden with Dad. But Bingo gets upset, when she discovers a walking leaf insect and Dad is too caught up in the game to notice.', 7, '/yFCjrfxQLeWaoN3XcUYGnnml3pA.jpg', '2018-10-06', '2025-11-18 17:57:03.828803', '2025-11-18 17:57:03.828803');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (536, 2, 1593873, 1, 7, 'BBQ', 'It''s lunchtime on Bluey''s back deck! But every BBQ needs a side salad, so Bingo''s relaxing sit-down will have to wait until she finds every colour of capsicum her cousins asked for!', 7, '/yIiT5Js01PYXIKpJv00KuMx2paG.jpg', '2018-10-07', '2025-11-18 17:57:03.828804', '2025-11-18 17:57:03.828804');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (537, 2, 1593874, 1, 8, 'Fruitbat', 'Not wanting to go to bed, Bluey tries to dream about being a nocturnal fruit bat so she can stay up all night long and soon finds herself flying through the night sky.', 7, '/jK63ogwEHXrts80FmOEABqWE3BW.jpg', '2018-10-08', '2025-11-18 17:57:03.828804', '2025-11-18 17:57:03.828805');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (538, 2, 1593881, 1, 9, 'Horsey Ride', 'When Bluey forgets to put her favourite toy away, cousin Socks grabs it and won''t let go! The kids stage a horsey wedding to distract her, with Dad and Uncle Stripe as the horses!', 7, '/vhFYMpKCXV1wTCfqZDEUJJHn0QJ.jpg', '2018-10-09', '2025-11-18 17:57:03.828805', '2025-11-18 17:57:03.828805');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (539, 2, 1593882, 1, 10, 'Hotel', 'Bluey and Bingo run a crazy "Hotel" with Dad as their put upon guest. But when Bingo quits over Bluey being too controlling, Dad needs to teach them the importance of compromise.', 7, '/mFyLt6qBB0dafVFZQlTdGGExM2h.jpg', '2018-10-10', '2025-11-18 17:57:03.828806', '2025-11-18 17:57:03.828806');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (540, 2, 1593885, 1, 11, 'Bike', 'At the park, Bluey is struggling to learn how to ride her bike. But as she and Dad watch her friends determination with their own tasks, Bluey is inspired to give it another try.', 7, '/aOPQxhssWj8H7YFbQVDlZqKVhfx.jpg', '2018-10-11', '2025-11-18 17:57:03.828806', '2025-11-18 17:57:03.828807');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (541, 2, 1593937, 1, 12, 'Bob Bilby', 'When it''s Bingo''s turn to bring her Kindy''s Bob Bilby puppet home and record their weekend in the scrapbook, the family resolve to put down their screens and show him a good time.', 7, '/wsxhWcHZIjqGjpWrkonTaRXe7tj.jpg', '2018-10-12', '2025-11-18 17:57:03.828807', '2025-11-18 17:57:03.828807');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (542, 2, 1593938, 1, 13, 'Spy Game', 'When Bingo stops playing Bluey''s spy game in the park, their device to control the grown-ups stops working properly! Bluey now sees how important Bingo is and needs to win her back!', 7, '/4qlxb1AsumuyvHbNbFLR2Onuvl.jpg', '2018-10-13', '2025-11-18 17:57:03.828808', '2025-11-18 17:57:03.828808');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (543, 2, 1593939, 1, 14, 'Takeaway', 'Forced to wait five minutes in front of a restaurant for their takeaway order, Bluey and Bingo become restless for entertainment, pushing the very limits of Dad''s patience.', 7, '/wafyBQrONgZPjYdALYbXHJZ5pPI.jpg', '2018-10-14', '2025-11-18 17:57:03.828808', '2025-11-18 17:57:03.828809');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (544, 2, 1593940, 1, 15, 'Butterflies', 'Playing ''Butterflies'' in the backyard is great fun, until Bluey runs away with Judo leaving Bingo all alone. Now poor Bingo''s heartbroken and Bluey needs to make amends.', 7, '/7pMrJZyiPOM4KbwXgd25yXEysVN.jpg', '2018-10-15', '2025-11-18 17:57:03.828809', '2025-11-18 17:57:03.828809');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (545, 2, 1593941, 1, 16, 'Yoga Ball', 'Bingo loves horsing around with Dad, but sometimes he forgets Bingo is smaller than her sister. Mum teaches Bingo how to use her big girl bark to keep their fun within her limits.', 7, '/kLg2kMqsAaHOzq7J9BBcTUb7B5M.jpg', '2018-10-16', '2025-11-18 17:57:03.82881', '2025-11-18 17:57:03.82881');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (546, 2, 1593942, 1, 17, 'Calypso', 'At school, Bluey and her friends throw themselves into various games. Teacher Calypso keeps her charges on track with a wise word and a song... all except the mysterious Pretzel.', 7, '/yg7uuNk1gK691GVsoLAoJUslMZN.jpg', '2018-10-17', '2025-11-18 17:57:03.828811', '2025-11-18 17:57:03.828811');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (547, 2, 1593943, 1, 18, 'The Doctor', 'Honey is stuck waiting for Dr Bingo''s as the other, more exciting injuries get seen before her. Receptionist Bluey tells her to be patient, some of these cases are a real pickle!', 7, '/eAsVhkNZFod4j2SEoXkDA4QZQoF.jpg', '2018-10-18', '2025-11-18 17:57:03.828811', '2025-11-18 17:57:03.828812');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (548, 2, 1593966, 1, 19, 'The Claw', 'When Bluey and Bingo are unable to grab a prize on a Magic Claw machine, Mum and Dad create their own version at home. But Dad isn''t about to make winning easy.', 7, '/vDmrxFxIuAfXBq6bLizpIA1aWC6.jpg', '2018-10-19', '2025-11-18 17:57:03.828812', '2025-11-18 17:57:03.828812');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (549, 2, 1597231, 1, 20, 'Markets', 'When Bluey visits the markets with five bucks from the tooth fairy, the options are endless. But as she and Indy scour the stalls for the perfect purchase, spending it proves hard.', 7, '/l9uYp4PFr12T4RBcNLq2bK4IpKi.jpg', '2018-10-20', '2025-11-18 17:57:03.828813', '2025-11-18 17:57:03.828813');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (550, 2, 1597232, 1, 21, 'Blue Mountains', 'Bluey, Bingo, Mum and Dad play a game of hand puppets, exploring the land beyond the Blue Mountains where they outsmart the Cheeky Fox to find the softest beds in the world.', 7, '/3uzpV4RXF38lbTrZ2SMhheSamsa.jpg', '2018-10-21', '2025-11-18 17:57:03.828813', '2025-11-18 17:57:03.828814');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (551, 2, 1597233, 1, 22, 'The Pool', 'Packing for the pool, Bluey and Dad tease Mum about being so fussy with what to take. But when they arrive underprepared, they realise a little planning goes a long way.', 7, '/jG1A6M3iIBso6YqVDaXvvvMFGq9.jpg', '2018-10-22', '2025-11-18 17:57:03.828814', '2025-11-18 17:57:03.828814');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (552, 2, 1597234, 1, 23, 'Shops', 'Playing ''Shops'' is the best game ever for Bluey and her friends - if they can ever get started! With Bluey questioning the rules and changing who''s who, they might be here all day!', 7, '/hXcovq3Cu4hlc8UCvhIZDKkaYaG.jpg', '2018-10-23', '2025-11-18 17:57:03.828815', '2025-11-18 17:57:03.828815');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (553, 2, 1601150, 1, 24, 'Wagonride', 'Bluey can''t wait to get to the monkey bars as Dad takes her and Bingo on a wagon ride to the park. But her patience is tested when Dad keeps stopping to chat with other grown-ups.', 7, '/9kvwBygFGtRiCugSjZa5U6hmJcO.jpg', '2018-10-24', '2025-11-18 17:57:03.828815', '2025-11-18 17:57:03.828816');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (554, 2, 1601151, 1, 25, 'Taxi', 'Bluey is running a taxi service. Her first passenger is Businessman Dad, who is in a rush to get to the airport. But with unexpected delays, Dad''s in danger of missing his flight!', 7, '/lMfAZViQaxM9UD3ObU56X04wi0S.jpg', '2018-10-25', '2025-11-18 17:57:03.828816', '2025-11-18 17:57:03.828816');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (555, 2, 1601152, 1, 26, 'The Beach', 'As Mum goes for a walk along the beach, Bluey runs to catch up with her. Along the way, she has a series of encounters that both excite and test her in her first solo adventure.', 7, '/lRaV9XdB8bZlkWAVvE7KycwTtCW.jpg', '2018-10-26', '2025-11-18 17:57:03.828817', '2025-11-18 17:57:03.828817');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (556, 2, 1833711, 1, 27, 'Pirates', 'Bluey, Bingo and Missy pretend to be pirates on the hamock swing at the park playground. Missy is frightened of the journey on the imaginary ship, but faces her fear to rescue her friends from the inside stomach of a whale.', 7, '/1CVOBYCLNtxUHQzLaTKtFwoVVYq.jpg', '2019-04-01', '2025-11-18 17:57:03.828818', '2025-11-18 17:57:03.828818');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (557, 2, 1833712, 1, 28, 'Grannies', 'Bluey and Bingo dress up as grandmothers, but disagree on if grandmothers are able to perform the floss dance or not. Bluey proves that they are not by video calling Nana, but when this upsets Bingo, Bluey decides to teach Nana the dance so that Bingo will keep playing.', 7, '/h1cc2RR89DKq62adX4wHq0GggRf.jpg', '2019-04-02', '2025-11-18 17:57:03.828818', '2025-11-18 17:57:03.828819');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (558, 2, 1833713, 1, 29, 'The Creek', 'Dad takes Bluey, Bingo and Mackenzie to the creek after they grow tired of the local playground. Bluey struggles to appreciate the beauty of the natural world surrounding her, until they arrive at the water. Bluey learns to step out of her comfort zone and try new things.', 7, '/9TJ9R6yHokHi9vyOqS5JluJYAvn.jpg', '2019-04-03', '2025-11-18 17:57:03.828819', '2025-11-18 17:57:03.828819');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (559, 2, 1833714, 1, 30, 'Fairies', 'When the family suspects that their house has been invaded by fairies, Bluey, Bingo, Mum and Dad go on a hunt to search for and capture the invisible creatures. Dad accidentally hurts Bingo''s feelings and makes it up to her by outsmarting the fairies.', 7, '/ur2u40xuVPM8JcKxiFHHMQFnxmk.jpg', '2019-04-04', '2025-11-18 17:57:03.82882', '2025-11-18 17:57:03.82882');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (560, 2, 1833716, 1, 31, 'Work', 'Bluey and Bingo roleplay a day at work. Dad acts as the boss of a drainpipe factory and hires Bluey and Bingo after their successful interviews. The day takes a turn when Bluey takes control of the company and fires Dad for his breach of the strict "no dancing" rules.', 7, '/fEfNl9WNx0yYqlXQySir7bHrOFU.jpg', '2019-04-05', '2025-11-18 17:57:03.82882', '2025-11-18 17:57:03.828821');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (561, 2, 1833719, 1, 32, 'Bumpy and the Wise Old Wolfhound', 'Bingo is sick in hospital, so Bluey and her Dad make, and send her a homemade video to lift her spirits. It tells the tale of Barnicus'' quest to heal her spotty dog named Bumpy.', 7, '/hDbLiheC6Pk1Ms6aqbxjFPwuBVT.jpg', '2019-04-06', '2025-11-18 17:57:03.828821', '2025-11-18 17:57:03.828821');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (562, 2, 1833720, 1, 33, 'Trampoline', 'When Dad has to stop having fun with the girls and go to work, Bluey and Bingo scramble to keep him playing games with them on the trampoline at the same time.', 7, '/wgSRgjuS90r2lihm2YgrvVoBfix.jpg', '2019-04-07', '2025-11-18 17:57:03.828822', '2025-11-18 17:57:03.828822');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (563, 2, 1833721, 1, 34, 'The Dump', 'Dad takes Bluey and Bingo on a car trip to the dump to throw away rubbish. Bluey asks Dad a range of questions on the way and he proclaims that he knows everything. But when they arrive, Bluey is saddened to learn that he is throwing away her old drawings.', 7, '/fzCuVY77jrvWLzummwcTdFqdDoE.jpg', '2019-04-08', '2025-11-18 17:57:03.828823', '2025-11-18 17:57:03.828823');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (564, 2, 1836006, 1, 35, 'Zoo', 'Bluey and Bingo set up a pretend zoo at home in the backyard, with Bluey acting as the zookeeper who takes Bingo and Mum on a tour around the grounds. Bluey must devise a plan to catch the baboon (Dad) when he escapes the enclosure and takes Bingo along with him.', 7, '/inRr9Te55NSBL8m8G3mG2F8OB4h.jpg', '2019-04-09', '2025-11-18 17:57:03.828823', '2025-11-18 17:57:03.828824');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (565, 2, 1836007, 1, 36, 'Backpackers', 'Bluey, Bingo, Muffin and Socks roleplay a pretend backpacking adventure around the backyard. The children become the backpacks as Mum and Dad are tasked with carrying them around while exploring their holiday destination.', 7, '/dmbPaTbyud4z0AMbAZc1gPZgLCj.jpg', '2019-04-10', '2025-11-18 17:57:03.828824', '2025-11-18 17:57:03.828824');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (566, 2, 1836008, 1, 37, 'The Adventure', 'Bluey plays with Chloe and pretends to be a horse as she accompanies the princess on an imaginary adventure to find food at the family farm. The friends swap roles and adopt a variety of personas as they save the kingdom from an evil queen.', 7, '/rwnos52lEMJRHscrtwgqgIlmT0m.jpg', '2019-04-11', '2025-11-18 17:57:03.828825', '2025-11-18 17:57:03.828825');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (567, 2, 1836009, 1, 38, 'Copycat', 'Dad wakes to find Bluey copying his every move. While the pair are playing outside, Bluey finds an injured budgie. They take the bird to the vet and learn that it has died. When they get home, Bluey reenacts the events with Bingo to cope with the budgie''s death.', 7, '/kwsAfCN0HheRLnPwRriBwqgnqjw.jpg', '2019-04-12', '2025-11-18 17:57:03.828825', '2025-11-18 17:57:03.828826');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (568, 2, 1836010, 1, 39, 'The Sleepover', 'Bluey and Bingo''s cousin Muffin arrives for a sleepover in an extremely tired state. Uncle Stripe explains that Muffin is transitioning from her daily naps. The sisters stay up late and play a game with Muffin, before helping her get to sleep when they realise she is exhausted.', 7, '/8lcNQoRB6NNyciddhHyYH4E7mW6.jpg', '2019-04-13', '2025-11-18 17:57:03.828826', '2025-11-18 17:57:03.828826');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (569, 2, 1836011, 1, 40, 'Early Baby', 'When Rusty and Indy''s two separate games at Bluey''s playgroup come into conflict, the groups explain their different activities to each other. After sharing, the friends find common ground with their games, and they decide to play together.', 7, '/AdTLNOUs3UJMlNFf6Suk911m467.jpg', '2019-04-14', '2025-11-18 17:57:03.828827', '2025-11-18 17:57:03.828827');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (570, 2, 1836012, 1, 41, 'Mums and Dads', 'While playing "Mums and Dads", Rusty and Indy have a disagreement about which parent should work, leading them to play separately. However, when they find that their friends have different ideas about how to play the game, the pair return to playing with each other again.', 7, '/fND9vJgw0LcxaiX135j3WlJdSCx.jpg', '2019-04-15', '2025-11-18 17:57:03.828828', '2025-11-18 17:57:03.828828');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (571, 2, 1836013, 1, 42, 'Hide and Seek', 'Bluey plays Hide and Seek with Bingo, Mum and Dad, but is quickly distracted by her toys, leaving her family hiding around the house undiscovered. When she slows down and focuses, Bluey remembers the game and successfully finds her family.', 7, '/5bF4qHS9itVNECu9zQt3XgWLbme.jpg', '2019-04-16', '2025-11-18 17:57:03.828828', '2025-11-18 17:57:03.828828');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (572, 2, 1836014, 1, 43, 'Camping', 'Bluey meets a French Labrador called Jean-Luc while on a camping trip with her family. The pair play together and build a camp site, but when Dad acts as a wild pig, the pair must find a way to communicate to combat the pig. Bluey is saddened when Jean-Luc leaves.', 7, '/iBCtT1JPG8CGpdJVNzDcskIBKNn.jpg', '2019-04-17', '2025-11-18 17:57:03.828828', '2025-11-18 17:57:03.828829');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (573, 2, 1836016, 1, 44, 'Mount Mumandad', 'Bluey and Bingo pretend that Mum and Dad are a mountain when they are tasked with playing a game without their parents'' participation. Bluey races ahead to reach the summit while Bingo brings along a backpack to carry the climbing equipment.', 7, '/eB3JRB2NzUUY5w5a710OcimR006.jpg', '2019-04-18', '2025-11-18 17:57:03.828829', '2025-11-18 17:57:03.828829');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (574, 2, 1836017, 1, 45, 'Kids', 'During a visit to the supermarket, Bluey adopts the role of the parent while Dad must act as the child alongside Bingo. When he tries to fill the trolley with the groceries, Dad gets in trouble with Bluey for being a disobedient child.', 7, '/zDM04knovkL51ZtvlDaPJkedrjc.jpg', '2019-04-19', '2025-11-18 17:57:03.828829', '2025-11-18 17:57:03.82883');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (575, 2, 1836018, 1, 46, 'Chickenrat', 'Before bed, Bingo loses her favourite cuddly toy. Mum helps Bluey and Bingo retrace their steps to find the lost item. The siblings recount their adventures as they remember playing with Dad, who was pretending to be a "chickenrat" creature.', 7, '/lhjphYTx3xu8bDUZtMKs2fykee7.jpg', '2019-04-20', '2025-11-18 17:57:03.82883', '2025-11-18 17:57:03.82883');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (601, 2, 2204638, 2, 20, 'Ticklecrabs', 'When Dad brings a pair of tenacious tickle crabs home from the beach, nowhere in the house is safe! His only hope of escaping their tickles is with help from his true love.', 7, '/hswxRS56uU3hs4SkzCeloY6tlJg.jpg', '2020-04-05', '2025-11-18 17:57:03.828851', '2025-11-18 17:57:03.828851');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (576, 2, 1836019, 1, 47, 'Neighbours', 'Bluey builds a pretend house and gains some new neighbours when Bingo, Mum and Dad move into the street. Bluey must learn to get along with a difficult neighbour when Bingo invades her space and spills over onto her property.', 7, '/255Jskg9R3MRQASUB4zAulrDZKg.jpg', '2019-04-21', '2025-11-18 17:57:03.82883', '2025-11-18 17:57:03.828831');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (577, 2, 1836020, 1, 48, 'Teasing', 'When Bluey teases Bingo, she argues that it is acceptable because Dad always teases her. The family recalls all of the times that Dad has made fun of them, but they ultimately learn that there is a difference between teasing and playing.', 7, '/2Q4Xa6mw6ppqmkH5Fc9VxWEOQfm.jpg', '2019-04-22', '2025-11-18 17:57:03.828831', '2025-11-18 17:57:03.828831');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (578, 2, 1836021, 1, 49, 'Asparagus', 'Dad tries to teach Bluey how to use manners while eating dinner at the dining table. However, when Mum gives Bluey a stick of asparagus which magically turns the family into animals, Bluey discovers the importance of manners while trying to control everyone.', 7, '/3YfsDHp13MyCjO9wQCZXIGd0EYl.jpg', '2019-04-23', '2025-11-18 17:57:03.828831', '2025-11-18 17:57:03.828831');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (579, 2, 1836022, 1, 50, 'Shaun', 'Bluey and Bingo try to convince Dad to get a pet, but he insists that they already have a pet; a disobedient emu called Shaun. Dad''s hand transforms into Shaun and the siblings learn how to look after their new pet by feeding, bathing and walking him.', 7, '/adZXKciVTu6oH96TZmPw9329Phr.jpg', '2019-04-24', '2025-11-18 17:57:03.828832', '2025-11-18 17:57:03.828832');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (580, 2, 1836023, 1, 51, 'Daddy Putdown', 'While Mum is out for the night at a friend''s baby shower, Dad must put Bluey and Bingo to bed as part of their evening routine. When the siblings are missing their mother, Bluey decides to set up a pretend baby shower of her own to take her mind off her anxiety.', 7, '/40QNX8ZGKhABEIVYTlYEhSYkzxL.jpg', '2019-04-25', '2025-11-18 17:57:03.828832', '2025-11-18 17:57:03.828832');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (581, 2, 4121335, 1, 52, 'Verandah Santa', 'It''s Christmas Eve and Dad and the kids are taking turns pretending to be Santa! But when Socks nips Bluey and Bluey refuses to leave her a present, they must all learn the true meaning of being good for Christmas.', 7, '/sWfySTiFtXhckIUTlqg5tVRj6hj.jpg', '2019-12-12', '2025-11-18 17:57:03.828833', '2025-11-18 17:57:03.828833');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (582, 2, 2194075, 2, 1, 'Dance Mode', 'After Dad eats her last chip, Bingo is given three chances to put Mum and Dad in ''Dance Mode'' as payback. But the others can''t resist taking Bingo''s turns for her.', 7, '/yobiCpcOyolRxpVJJ0y9PYUIqZf.jpg', '2020-03-17', '2025-11-18 17:57:03.828833', '2025-11-18 17:57:03.828833');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (583, 2, 2194076, 2, 2, 'Hammerbarn', 'On a trip to Hammerbarn, Bluey and Bingo create their own mini-homes side-by-side in the trolley. But Bluey quickly gets jealous of her neighbour Bingo.', 7, '/lIN7vBaTzPzv9Usl9OqQCZmGc9g.jpg', '2020-03-18', '2025-11-18 17:57:03.828833', '2025-11-18 17:57:03.828834');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (584, 2, 2194119, 2, 3, 'Featherwand', 'Bluey and Mum are off to Chloe''s party and Bingo isn''t invited. But armed with a magic featherwand that makes things incredibly heavy, Bingo can now stop them leaving the house.', 7, '/gZOBCTytqy7YDYUz4TJ8qcMxXIi.jpg', '2020-03-19', '2025-11-18 17:57:03.828834', '2025-11-18 17:57:03.828834');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (585, 2, 2194120, 2, 4, 'Squash', 'When Dad and Uncle Stripe play a game of squash, Bluey and Bingo are in control of their every move, and Bingo proves that big siblings don’t always beat little siblings.', 7, '/jq6hAhN36GMU9s6O0uHO8G3I3vf.jpg', '2020-03-20', '2025-11-18 17:57:03.828834', '2025-11-18 17:57:03.828835');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (586, 2, 2194122, 2, 5, 'Hairdressers', 'During a game of hairdressers, Bluey discovers that big-headed customer Bert Handsome has nits! To help treat them, Bingo has to find her voice, while Bluey has to find her ears.', 7, '/eTVRpM1PtX7LIG6kbkvCHnGKYy8.jpg', '2020-03-21', '2025-11-18 17:57:03.828835', '2025-11-18 17:57:03.828835');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (587, 2, 2194155, 2, 6, 'Stumpfest', 'Dad and his mates hit the backyard, ready to rip up some tree stumps! But when Bluey and Bingo take over a stump as a nail salon, Dad finds he''s got some negotiating to do.', 7, '/nTfZngqPl6nyFtZD0xbbWquTJkX.jpg', '2020-03-22', '2025-11-18 17:57:03.828836', '2025-11-18 17:57:03.828836');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (588, 2, 2194157, 2, 7, 'Favourite Thing', 'When Bluey accidentally makes Bingo upset playing a game at dinner, she will do anything to make her happy again - even changing the rules of the game. But nothing seems to work.', 7, '/jv9q9OnkzATUc9nTUSXHAmm8eM9.jpg', '2020-03-23', '2025-11-18 17:57:03.828836', '2025-11-18 17:57:03.82884');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (589, 2, 2194073, 2, 8, 'Daddy Dropoff', 'Dad refuses to be late dropping off Bluey and Bingo at kindy and school, but the girls make Dad play so many games, they quickly derail his plan.', 7, '/hyJtqtcdCcToISNaIuAUqDcKHqO.jpg', '2020-03-24', '2025-11-18 17:57:03.828841', '2025-11-18 17:57:03.828841');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (590, 2, 2194074, 2, 9, 'Bingo', 'When Bluey has a playdate at Chloe''s, Bingo must learn how to play by herself. But all the games she knows need more than one person! Luckily Dad has a problem that needs solving.', 7, '/3ddURgaQmmHRDw0JBnubWY0GZLZ.jpg', '2020-03-25', '2025-11-18 17:57:03.828841', '2025-11-18 17:57:03.828841');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (591, 2, 2194072, 2, 10, 'Rug Island', 'On Bingo and Bluey''s Rug Island, a pack of felt pens can be anything - bananas, campfires, even a snake! But Dad will need to embrace his inner kid if he wants to make it his home.', 7, '/wHEwbJCrQYlxiYg1ugT7RCms8yf.jpg', '2020-03-26', '2025-11-18 17:57:03.828842', '2025-11-18 17:57:03.828842');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (592, 2, 2194160, 2, 11, 'Charades', 'Bluey and Bingo want everyone to play Charades, but Muffin and Socks are too young to understand the rules and Nanna must think quickly to keep the game on track.', 7, '/mNBDckENRn45e3ooKVBexfpKUJ6.jpg', '2020-03-27', '2025-11-18 17:57:03.828842', '2025-11-18 17:57:03.828847');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (593, 2, 2170397, 2, 12, 'Sticky Gecko', 'Mum must get Bluey and Bingo out the door in time for a playdate, but they can''t leave before they finish their game - waiting for a sticky rubber gecko to drop from the ceiling.', 7, '/k0LIfTKVy0Nt9Z2xR6NywtRadN7.jpg', '2020-03-28', '2025-11-18 17:57:03.828847', '2025-11-18 17:57:03.828847');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (594, 2, 2204631, 2, 13, 'Dad Baby', 'When Dad shows the kids how to use their old baby-harness, a new game is born: Dad Baby! But Dad is unprepared for the harsh realities of giving birth to a baby Bingo.', 7, '/7f3UCRo8eLxVmsPQMw6vTTkGgSx.jpg', '2020-03-29', '2025-11-18 17:57:03.828848', '2025-11-18 17:57:03.828848');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (595, 2, 2204632, 2, 14, 'Mum School', 'Bluey plays mum to a brood of bouncy balloons, including an irrepressible floater named Greenie. But she soon discovers that mothering is much harder than she imagined.', 7, '/r2ha6ddJfZaYyhAw0P6TV0jPuFs.jpg', '2020-03-30', '2025-11-18 17:57:03.828848', '2025-11-18 17:57:03.828848');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (596, 2, 2204633, 2, 15, 'Trains', 'All aboard the Dad Train! Bingo goes from home to daycare to her job at the vet every morning, but there''s trouble on the line as a mischievous Bluey throws everyone off schedule.', 7, '/7hdcFlSERQT8o2e8SEbuj6VHPfI.jpg', '2020-03-31', '2025-11-18 17:57:03.828849', '2025-11-18 17:57:03.828849');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (597, 2, 2194162, 2, 16, 'Army', 'Jack''s the new dog at school and the newest recruit in Rusty''s army. Jack struggles with following instructions and always forgets his hat but Rusty will make a soldier of him yet.', 7, '/bWTMKLnIoFBMTXvbT7Wnt40JKNm.jpg', '2020-04-01', '2025-11-18 17:57:03.828849', '2025-11-18 17:57:03.828849');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (598, 2, 2204634, 2, 17, 'Fancy Restaurant', 'Bingo and Bluey want Mum and Dad to smoochy kiss, so they set up a romantic evening for two at their fancy restaurant. Everything goes to plan until Chef Bingo''s special arrives.', 7, '/zNVFqKAc5WlwNGfxAAcTAT3aBfm.jpg', '2020-04-02', '2025-11-18 17:57:03.82885', '2025-11-18 17:57:03.82885');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (599, 2, 2204636, 2, 18, 'Piggyback', 'The Heelers take a long riverside walk but Bingo''s legs are tired and she wants a piggyback. To distract her, Mum and Dad invent fun games and get her little legs moving again!', 7, '/rIs8xthKwklY3WpdCt0caO5ujZc.jpg', '2020-04-03', '2025-11-18 17:57:03.82885', '2025-11-18 17:57:03.82885');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (600, 2, 2204637, 2, 19, 'The Show', 'When Bingo drops Mum''s breakfast-in-bed on the floor, she''s convinced she''s ruined her big day. But Bluey helps make amends by putting on a play of how Mum and Dad first met.', 7, '/nRPpF0i5jMcbYSNgZxw3CeNoCWb.jpg', '2020-04-04', '2025-11-18 17:57:03.82885', '2025-11-18 17:57:03.828851');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (602, 2, 2218571, 2, 21, 'Escape', 'When Mum and Dad describe a made-up world where they can relax without the girls, Bluey and Bingo decide to burst into their fantasy and chase them down. How will Mum and Dad escape?', 7, '/uxszuXxNxKz0WH70JZ7dvbDwcTC.jpg', '2020-04-06', '2025-11-18 17:57:03.828852', '2025-11-18 17:57:03.828852');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (603, 2, 2218572, 2, 22, 'Bus', 'During a game of bus, passenger Mum is too scared to tell Bus Driver Dad that she secretly loves him, until she gets some help from the Grannies.', 7, '/3HffG0X3GUg9QVJdn9Xiy22yRjn.jpg', '2020-04-07', '2025-11-18 17:57:03.828852', '2025-11-18 17:57:03.828852');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (604, 2, 2218573, 2, 23, 'Queens', 'During a game of Queens, Bluey and Bingo find that playing the butler is much more fun. But someone must play the Queen, even if it means not being afraid of a bit of hard work.', 7, '/X9ktOXvkJsFj7OyLYQvXyL3kJl.jpg', '2020-04-08', '2025-11-18 17:57:03.828853', '2025-11-18 17:57:03.828853');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (605, 2, 2218574, 2, 24, 'Flat Pack', 'While Mum and Dad struggle to build new flat-pack furniture, Bluey and Bingo transform the empty boxes into their own new world.', 7, '/dkAN8roEFnGUjvi7hO6rYc8ceVs.jpg', '2020-04-09', '2025-11-18 17:57:03.828853', '2025-11-18 17:57:03.828853');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (606, 2, 2218575, 2, 25, 'Helicopter', 'At school, Bluey and her friends turn a tree stump into a thrilling game of Helicopter. But as the pilot, Bluey has to learn to give up some control so they can all have fun.', 7, '/eTwoAi4vL3rxOr5LfJ2JaFqav5P.jpg', '2020-04-10', '2025-11-18 17:57:03.828853', '2025-11-18 17:57:03.828854');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (607, 2, 2218576, 2, 26, 'Sleepytime', 'Inside Bingo''s dream, Bingo and Floppy have an intergalactic adventure, while the rest of her sleep-deprived family try to navigate Bingo''s non-stop night-time bedhopping.', 8, '/2892eHHJ9Tav4JA8MExApa4gZiV.jpg', '2020-04-11', '2025-11-18 17:57:03.828854', '2025-11-18 17:57:03.828854');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (608, 2, 2477727, 2, 27, 'Grandad', 'Grandad is supposed to be resting, but when Bluey and Bingo go to visit him, he makes a run for it with the kids and takes them on a madcap adventure into the bush.', 7, '/nue5cqVOONDiX8q5eEVVwkdSt5o.jpg', '2020-10-25', '2025-11-18 17:57:03.828854', '2025-11-18 17:57:03.828854');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (609, 2, 2477728, 2, 28, 'Seesaw', 'Dad has rudely plonked himself on one end of the seesaw. So Bluey and Bingo round up the entire playground to help flip him off, but they still need to find one more friend.', 7, '/hV8OMQWb1FvAdIoY1vJxlNls0jR.jpg', '2020-10-26', '2025-11-18 17:57:03.828855', '2025-11-18 17:57:03.828855');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (610, 2, 2480557, 2, 29, 'Movies', 'It is Bluey''s first trip to the cinema, but she''s worried that the movie will be too scary. When Bingo starts running amok in the theatre, she must conquer her fear and help Dad out.', 7, '/wFVhnckUgLhJRSOpWM2O9vOeRjw.jpg', '2020-10-27', '2025-11-18 17:57:03.828855', '2025-11-18 17:57:03.828855');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (611, 2, 2477729, 2, 30, 'Library', 'When Muffin is told that she is special by her Dad, she interprets it as an excuse to do anything she wants, which means playing Bluey and Bingo''s game of Library her way.', 7, '/awkZTdIMCHPRAzl7lGyThofp5XH.jpg', '2020-10-28', '2025-11-18 17:57:03.828856', '2025-11-18 17:57:03.828856');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (612, 2, 2477730, 2, 31, 'Barky Boats', 'Bluey and Mackenzie are excited to spend time with their two buddies Mia and Captain. When the older kids run off to play together without them, Calypso explains that growing up can be hard.', 7, '/7ZPYRPIYpRcfVcDYCl4BOZSx2gb.jpg', '2020-10-29', '2025-11-18 17:57:03.828856', '2025-11-18 17:57:03.828856');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (613, 2, 2477731, 2, 32, 'Burger Shop', 'It''s time for Bluey and Bingo to get out of the bath, but Dad has decided not to tell them what to do and gets roped into a game of Burger Shop.', 7, '/qqNxrPwS7qIgafPA86oCXYZCXLl.jpg', '2020-10-30', '2025-11-18 17:57:03.828856', '2025-11-18 17:57:03.828857');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (614, 2, 2477732, 2, 33, 'Circus', 'Bluey is the ringmaster in a game of circus with her friends, but Hercules wants to play his motorcycle game instead. Luckily Bluey has a solution to keep everyone happy.', 7, '/yXtCgOicMTFx7ChnyiLCJlnkc7s.jpg', '2020-10-31', '2025-11-18 17:57:03.828857', '2025-11-18 17:57:03.828857');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (615, 2, 2477733, 2, 34, 'Swim School', 'Mum, Dad and Bingo must complete both their classes to pass Swim School but pleasing strict Big Fish instructor Margaret (aka Bluey) is proving very difficult.', 7, '/zS7GR9L7isTaQy0NKxYJeo3O0KS.jpg', '2020-11-01', '2025-11-18 17:57:03.828857', '2025-11-18 17:57:03.828857');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (616, 2, 2477734, 2, 35, 'Cafe', 'In the park Bluey meets a new playmate Winnie, but when Bluey wants to invite her and her dad home for breakfast, she learns that adults take a little bit longer to make friends.', 7, '/iOLlDI2OWoRhSv2Rm38iTQjLV1m.jpg', '2020-11-02', '2025-11-18 17:57:03.828858', '2025-11-18 17:57:03.828858');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (617, 2, 2477735, 2, 36, 'Postman', 'When Mum and Dad have a disagreement, Bluey makes Dad write a love letter to Mum to make up. Now Bluey must find a way to play Ground''s Lava with Bingo and deliver the letter to Mum without squabbling.', 7, '/sxz3z3FNlY6oHnIA73Hp8lm41Ej.jpg', '2020-11-03', '2025-11-18 17:57:03.828858', '2025-11-18 17:57:03.828858');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (618, 2, 2477736, 2, 37, 'The Quiet Game', 'Bluey and Bingo are playing "The Quiet Game" and won''t use words to tell Dad which toy to buy for Muffin. At his wits end, Dad recruits new store clerk Alfie to help interpret the girls miming.', 7, '/m3ucz85WzhQlvNl2YWMbQNqxlqM.jpg', '2020-11-04', '2025-11-18 17:57:03.828859', '2025-11-18 17:57:03.828859');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (619, 2, 2477737, 2, 38, 'Mr Monkeyjocks', 'Dad thinks the kids have too many toys and suggests a chuck out. To save their beloved Mr Monkeyjocks from getting the chop, Bluey and Bingo must prove he is special.', 7, '/78wXNdx2I6B1AbqraGsHU3V5U4W.jpg', '2020-11-05', '2025-11-18 17:57:03.828859', '2025-11-18 17:57:03.828859');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (620, 2, 2477739, 2, 39, 'Double Babysitter', 'When Uncle Rad and Frisky accidentally turn up to babysit Bluey and Bingo on the same night, they have to work together to make Bluey feel better about babysitter putdowns.', 7, '/3l6AIdK0uLKw4zKOsZ97YWjXAKF.jpg', '2020-11-06', '2025-11-18 17:57:03.82886', '2025-11-18 17:57:03.82886');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (621, 2, 2499229, 2, 40, 'Bad Mood', 'Bingo is playing Bad Mood with Dad, standing on his feet as Dad stomps around the house, controlling everything Bingo does and causing chaos. But how will Bluey get her to snap out of it?', 7, '/kZXEVaIiVandvjUnEjVLEQA4WG1.jpg', '2020-11-07', '2025-11-18 17:57:03.82886', '2025-11-18 17:57:03.82886');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (622, 2, 2499230, 2, 41, 'Octopus', 'Chloe is exhilarated while playing "Octopus" at Bluey''s house, and tries to replicate the experience at home with her own father. Chloe becomes disheartened when her father struggles to play the game with the same zest as Bluey''s father. This leads Chloe''s father to research the octopus, which helps the duo to improvise and reinvent the activity in their own way.', 7, '/ygpwh2EIYQHkqOGZSFZ8EkuBWCJ.jpg', '2020-11-08', '2025-11-18 17:57:03.82886', '2025-11-18 17:57:03.828861');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (623, 2, 2499231, 2, 42, 'Bin Night', 'Bluey and Bingo help Dad take out the bins at night for rubbish collection, and watch with Mum as the garbage truck arrives the next morning. Over a consecutive few weeks, Bingo recounts how a new student at kindergarten has been calling her names. After initially being tolerant, Bingo eventually finds a way to become friends with her new classmate.', 7, '/f9z1CZhWUfcDvMmTlOPrmYfajPZ.jpg', '2020-11-09', '2025-11-18 17:57:03.828861', '2025-11-18 17:57:03.828861');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (624, 2, 2499233, 2, 43, 'Muffin Cone', 'When Muffin won''t stop sucking her thumb, Aunt Trixie puts her in a dog collar to help break the habit. Muffin is angered, while Bluey and Bingo are frustrated that their cousin can''t play with them due to her restricted movement. The sisters think of games that Muffin will still be able to join in with while wearing her "cone of shame".', 7, '/fax8Pj4G495WGOILxdZW9bFPQxa.jpg', '2020-11-10', '2025-11-18 17:57:03.828861', '2025-11-18 17:57:03.828861');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (625, 2, 2499234, 2, 44, 'Duck Cake', 'Dad sets out to prepare a famous duck-shaped cake for Bingo''s birthday, which proves to be more difficult than he anticipated. Concurrently, he implores Bluey to clean up her toys, but she struggles to find the motivation to do so. When she sees her father become dispirited while baking, Bluey begins to understand the value of assisting others.', 7, '/zufBnRBvgQ1aLsecfPOaqA0Dc2z.jpg', '2020-11-11', '2025-11-18 17:57:03.828862', '2025-11-18 17:57:03.828862');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1425, 115, 1026331, 5, 15, 'Money Talks', 'Mr. Krabs makes a wish that he could talk to money.', 7, '/dVkyWOVvDjKMauYmiqfJLhFdWJJ.jpg', '2007-07-31', '2025-11-18 17:58:02.951838', '2025-11-18 17:58:02.951838');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (626, 2, 2499235, 2, 45, 'Handstand', 'At her birthday party, Bingo attempts to perform a handstand, but feels overlooked when no one seems to notice her. Nana also feels out of place when she realises that no one has a job for her or requires her assistance. Ultimately, Bingo and Nana find each other and Nana watches Bingo as she accomplishes her handstand.', 7, '/w9WwaurvnVnsNELGFzSNvXOs1bL.jpg', '2020-11-12', '2025-11-18 17:57:03.828862', '2025-11-18 17:57:03.828862');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (627, 2, 2477748, 2, 46, 'Road Trip', 'Mum helps Bluey and Bingo find ways to entertain themselves on a family road trip, while Dad tries to stay ahead of the grey nomad convoy or risk camping near the toilets.', 7, '/smpe17I0K6IiwghRnPYPZ1HyJqK.jpg', '2020-11-13', '2025-11-18 17:57:03.828863', '2025-11-18 17:57:03.828863');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (628, 2, 2477742, 2, 47, 'Ice Cream', 'Bluey and Bingo want a lick of each other''s ice cream. But they are so focused on making sure each lick is fair, they don''t notice their ice creams are melting.', 7, '/3mA8pzNzrhZpKFxk2RZR5Ghpebn.jpg', '2020-11-14', '2025-11-18 17:57:03.828863', '2025-11-18 17:57:03.828863');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (629, 2, 2477745, 2, 48, 'Dunny', 'Mum bans the girls from saying the word ''dunny'' because it''s not a word The Queen would use, but the kids try and trick her into saying it anyway.', 7, '/tLgptlPvDShy2kPcGKowwLZy6Ii.jpg', '2020-11-15', '2025-11-18 17:57:03.828863', '2025-11-18 17:57:03.828864');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (630, 2, 2477738, 2, 49, 'Typewriter', 'Bluey, Snickers and Winton are on their way to ask Calypso for help with their problems, when they are ambushed by the Terriers and use their unique talents to get past.', 7, '/9Pmd8705VW0GJK64Sc9czh88fgP.jpg', '2020-11-16', '2025-11-18 17:57:03.828864', '2025-11-18 17:57:03.828867');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (631, 2, 2499236, 2, 50, 'Baby Race', 'Mum reminisces about Bluey and Judo as babies. Bluey learnt to roll over first, but Judo was the first to crawl, so then it became a race to see who was going to walk first!', 7, '/cBzUkj9zgE2XE4Iw1QNuM0D7wSF.jpg', '2020-10-25', '2025-11-18 17:57:03.828867', '2025-11-18 17:57:03.828867');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (632, 2, 2546303, 2, 51, 'Christmas Swim', 'The Heelers gather for a classic Aussie Christmas, Bluey gets a new teddy and introduces him to the whole family. But the family play too rough with him and now he wants to go home, until Frisky convinces him to stay.', 7, '/pZXnsut1BVWC2KHFvBdiTxhWZ68.jpg', '2020-12-01', '2025-11-18 17:57:03.828868', '2025-11-18 17:57:03.828868');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (633, 2, 2849947, 2, 52, 'Easter', 'Bingo is convinced the Easter Bunny has forgotten them like last year, until Bluey finds a series of clues that leads them on an Easter egg treasure hunt.', 7, '/gtbjeIWFGSLpgSMYXFhd3z0Dgwg.jpg', '2021-04-04', '2025-11-18 17:57:03.828868', '2025-11-18 17:57:03.828868');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (634, 2, 3184754, 3, 1, 'Perfect', 'Bluey''s Father''s Day card has to be perfect but she can''t decide what to draw! So Mum reminds her about all the fun times she''s had with Dad and how he''s not so perfect either.', 7, '/b9X8YYaMz2X5SkPBWFyWvFin34X.jpg', '2021-09-05', '2025-11-18 17:57:03.828869', '2025-11-18 17:57:03.828869');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (635, 2, 3348511, 3, 2, 'Bedroom', 'Bluey is excited to get her own room. But when bed time comes, she misses Bingo more than she expected and must find a way to stay in touch with her sister.', 7, '/m2onzCMfZVJ8a7CW8KpYSmz8iaa.jpg', '2021-11-22', '2025-11-18 17:57:03.828869', '2025-11-18 17:57:03.828869');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (636, 2, 3350881, 3, 3, 'Obstacle Course', 'Mum sets up a backyard obstacle course just for fun, but Dad wants to race! Now the kids are determined to win by any means necessary.', 7, '/zEc2CD0bu9Kwm66akDgNQeyFleF.jpg', '2021-11-23', '2025-11-18 17:57:03.828869', '2025-11-18 17:57:03.82887');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (637, 2, 3350894, 3, 4, 'Promises', 'Bluey keeps breaking her promises! But after seeing how much Bingo trusts Mum''s word, Bluey learns the power of promises and why it''s important not to break them.', 7, '/uwgsPkWU43I7UeX0SvX6do1smcF.jpg', '2021-11-24', '2025-11-18 17:57:03.82887', '2025-11-18 17:57:03.82887');
