INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (776, 32, 896971, 1, 11, 'Hey Pizza!', 'Cyborg and Beast Boy try to capitalize on Zippy''s Pizza''s "thirty minutes or its free" deal, but the delivery boy is seemingly unstoppable. It becomes a bit of a challenge as an all-out war of wits between them erupts. Meanwhile, Robin struggles with whether to build a senior center or a pool (leaning toward the pool mostly to see Starfire in a bikini).', 11, '/AVdK9JGk9fpw9g5z3xEeO2Y0FM.jpg', '2013-06-04', '2025-11-18 17:57:29.119248', '2025-11-18 17:57:29.119248');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (838, 32, 1028012, 2, 21, 'Body Adventure', 'Cyborg is infected with a cold and the Titans shrink down to fight it off.', 11, '/c6GzeM087T6fcLFmeiXX2QzwWoy.jpg', '2014-11-13', '2025-11-18 17:57:29.119297', '2025-11-18 17:57:29.119298');
