INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (779, 32, 896975, 1, 14, 'You''re Fired!', 'Beast Boy''s behavior causes him to be fired from the Teen Titans and replaced by a pair of shape-shifting twins.', 11, '/hWfq2AUK6Q8ZLpx9kOwjbyfANVY.jpg', '2013-06-25', '2025-11-18 17:57:29.11925', '2025-11-18 17:57:29.11925');
