INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1201, 32, 6635834, 9, 34, 'Ruler''s Rule', 'Robin teaches the other Titans how to properly use a ruler.', NULL, NULL, '2025-11-29', '2025-11-18 17:57:29.119586', '2025-11-18 17:57:29.119587');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1202, 9, 5421347, 1, 1, 'Mini Bluey', 'Kylie and Dannii Minogue voice Bluey and Bingo in a heartwarming tale of self-discovery and sisterly affection. Bluey devises a plan to become more like Bingo after their dad, Bandit, complains about how dissimilar they are.
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1203, 9, 5421349, 1, 2, 'The Creek', 'BINDI IRWIN narrates The Creek, a story about learning not to be scared of nature and seeing the beauty of the wild world outside. When Bluey is bored at the park Mackenzie suggests a trip to the creek. Bluey is unsure as she has never been there before – what will she find when she explores the creek?', NULL, '/sYV60aJeNBleElV58qIqwTIpLA1.jpg', '2024-02-26', '2025-11-18 17:57:30.780656', '2025-11-18 17:57:30.780656');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1252, 78, 5364813, 2, 17, 'Hamster Paradise / Puppy Papas / The Adorables', 'Chip & Dale Toughen up hamsters. / Chip & Dale agree to puppysit. / Chip & Dale go to a petting zoo.', 23, '/keIAA6mLTQ957c0A7rj8wuWAYXp.jpg', '2024-05-23', '2025-11-18 17:57:34.071538', '2025-11-18 17:57:34.071539');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1204, 9, 5421350, 1, 3, 'Barky Boats', 'TOM DALEY narrates Barky Boats, a story about what happens when we need to prepare for a big new adventure. Bluey wants to make a fairy garden with her buddy Mia, but Mackenzie wants to play barky boats with his buddy Captain.
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1205, 9, 5421351, 1, 4, 'Easter', 'ROMESH RANGANATHAN narrates ‘Easter'', a story about patience and remembering that we''re rememberable!
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1206, 9, 5421352, 1, 5, 'Grannies', 'Suranne Jones reads ‘Grannies'', featuring everyones favourite Nanas: Janet and Rita!
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1207, 9, 5421353, 1, 6, 'Charades', 'JENNA FISCHER narrates Charades. Bluey, Bingo, Muffin, and Socks are staying at Nana''s and decide to play a game of charades. Muffin, however, doesn''t quite understand the rules! Bluey and Bingo wonder why they have to play along, but there''s only one important rule to remember when you''re at Nana''s house: you get what you want!', NULL, NULL, '2024-04-19', '2025-11-18 17:57:30.78066', '2025-11-18 17:57:30.78066');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1208, 9, 5421354, 1, 7, 'Mum School', 'Eva Mendes narrates Mum School. Bluey wants Mum to grade her on her parenting skills as she attempts to parent five bouncy balloons, but one named Greenie proves tricky to handle! After observing Dad parent Bingo, Bluey finally knows how to treat Greenie right…', NULL, NULL, '2024-05-03', '2025-11-18 17:57:30.780661', '2025-11-18 17:57:30.780661');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1209, 9, 5421355, 1, 8, 'Swim School', 'Jordan Fisher narrates Swim School. Bluey is playing two swim school teachers: Karen and (the much meaner) Margaret! Mum, Dad, and Bingo reckon they can pass Margaret''s Big Fish classes without dobbing on each other, but it''s proving to be quite the challenge…', NULL, NULL, '2024-05-17', '2025-11-18 17:57:30.780661', '2025-11-18 17:57:30.780662');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1210, 9, 5421356, 1, 9, 'The Beach', 'Camille Cottin narrates ‘The Beach'', a story about Bluey embarking on a solo quest across the shoreline!
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1211, 9, 5421357, 1, 10, 'Daddy Putdown', 'Rob Delaney narrates ‘Daddy Putdown'', a story about Bluey learning to play and have fun when Mum is away.
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1212, 9, 6022529, 1, 11, 'Verandah Santa', 'It''s Christmas Eve and Bluey, Bingo, Muffin and Socks can''t wait to open their presents. But Bluey''s dad reminds them that no peeking or no presents! So, they decide to play a game called Verandah Santa to practice no peeking. What will Santa bring them? A Bluey Christmas story, Read by Adam Hills.', 7, NULL, '2024-11-11', '2025-11-18 17:57:30.780664', '2025-11-18 17:57:30.780665');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1213, 9, 6022530, 1, 12, 'Christmas Swim', 'Ian Thorpe narrates Christmas Swim, a story about giving new families a chance (even if they are a bit crazy!).
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1214, 9, 6146151, 2, 1, 'What Games Should We Play?', 'Cookie Monster and Elmo read a special story from their friends in Brisbane Australia…"What Games Should We Play?"
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1215, 9, 6595062, 2, 2, 'Queens', 'Helena Bonham Carter reads "Queens", a story about not being afraid of a bit of hard work. Bluey and Bingo are taking turns being Queen and Butler – but they both think that being Butler is a lot more fun than being Queen!
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1216, 21, 3177956, 1, 1, 'The Champion', 'What goes on within the heart of a Champion? Doubts? Regrets? Determination? Maybe all three? Leon, the greatest Pokémon Champion Galar has known, prepares to face one of his biggest challenges ever!', 8, '/cV71J4LgECsEniAd8bmB4JAR9sA.jpg', '2021-09-09', '2025-11-18 17:57:31.872943', '2025-11-18 17:57:31.872947');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1217, 21, 3177957, 1, 2, 'The Eclipse', 'With a dash of determination and courage, Lillie vows to rescue her mother and bring back her friend Nebby! But be strong, Lillie—there seems to be a sinister presence on the horizon…', 9, '/pKacFcDvUqoOuqN3K2AH3vx8nB5.jpg', '2021-09-23', '2025-11-18 17:57:31.872948', '2025-11-18 17:57:31.872948');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1218, 21, 3177958, 1, 3, 'The Visionary', 'When chasing your dream, do you give up when everyone tells you it’s wrong? Should you listen? Or do you continue to follow your vision, even if it puts all of Kalos at risk? For Lysandre, that’s never been a question…', 7, '/pZpWrl2L2dKwkw5rUPk5bAVagMu.jpg', '2021-10-07', '2025-11-18 17:57:31.872949', '2025-11-18 17:57:31.872949');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1219, 21, 3177959, 1, 4, 'The Plan', 'A sinister plot that manipulates both people and Pokémon has been realized! All of Ghetsis’s schemes are falling into place, but what does that mean for the fate of the Unova region?', 9, '/bV6rlRmEDlEDbcVjx6tCaIO2Pxh.jpg', '2021-10-21', '2025-11-18 17:57:31.87295', '2025-11-18 17:57:31.87295');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1220, 21, 3177960, 1, 5, 'The Rival', 'No matter how fast you run, your rivals are always one step ahead, pushing you to better your skills. Eventually, you’ll have to face your rival in your travels… for Barry, that time has come.', 7, '/eAkzRrsFQ3TlrR2Ns1AXqQj22Iu.jpg', '2021-12-02', '2025-11-18 17:57:31.87295', '2025-11-18 17:57:31.87295');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1221, 21, 3177962, 1, 6, 'The Wish', 'Her whole life, Zinnia was told to put her people’s wishes before her own and to uphold her duty to Hoenn. But when the Legendary Pokémon Rayquaza arrives, will she have what it takes?', 11, '/tMnpd3HKxuJ0BbpElRxb0igbcDD.jpg', '2021-12-09', '2025-11-18 17:57:31.872951', '2025-11-18 17:57:31.872951');
