INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1264, 115, 1001270, 1, 11, 'Home Sweet Pineapple', 'One night, some nematodes feast on SpongeBob''s pineapple house. All that is left is a tiny pebble. Now, SpongeBob must live with his parents! How will he get a new house?', 11, '/1506U2ipvdvTjAPkr1ydhVBWQyu.jpg', '1999-08-14', '2025-11-18 17:58:02.951691', '2025-11-18 17:58:02.951692');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1265, 115, 1001271, 1, 12, 'Mermaid Man and Barnacle Boy', 'SpongeBob and Patrick find that their television heroes, Mermaid Man and Barnacle Boy, are retired old people. SpongeBob and Patrick try to get them back into Superhero business again.', 11, '/3oKtrnpDfyRGC46zEqTYrSel9yR.jpg', '1999-08-21', '2025-11-18 17:58:02.951693', '2025-11-18 17:58:02.951693');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1266, 115, 1001272, 1, 13, 'Pickles', 'SpongeBob gives an incomplete Krabby Patty to Bubble Bass for the first time. SpongeBob goes crazy, and forgets how to do everything, including his job.', 11, '/rTARZGi2hlY1gDE8e6zBqK61uhK.jpg', '1999-08-21', '2025-11-18 17:58:02.951694', '2025-11-18 17:58:02.951694');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1267, 115, 1001273, 1, 14, 'Hall Monitor', 'SpongeBob is finally given the chance to be a hall monitor at his boating school, but he wastes the school day giving a speech and doesn''t get to do anything. That doesn''t mean he can''t be a Hall Monitor outside of school, right?', 11, '/5XisgO9apIyPIznk3kNSxEjBMmu.jpg', '1999-08-28', '2025-11-18 17:58:02.951695', '2025-11-18 17:58:02.951695');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1268, 115, 1001274, 1, 15, 'Jellyfish Jam', 'A wild jellyfish follows SpongeBob home, so he decides to keep it. The jellyfish loves to party and dance. Unluckily, SpongeBob''s house turns into a party overnight with more jellyfish coming by the second.', 11, '/4aVHJxnNUc4fwZQc49EsJMPpm6A.jpg', '1999-08-28', '2025-11-18 17:58:02.951696', '2025-11-18 17:58:02.951696');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1269, 115, 1001275, 1, 16, 'Sandy''s Rocket', 'SpongeBob and Patrick accidentally launch Sandy''s rocket, and land back in Bikini Bottom. They think they''ve landed on the moon and that everyone in Bikini Bottom are aliens.', 11, '/5NO6bDAkVGvsqNT5gTF6A5QgQ3K.jpg', '1999-09-04', '2025-11-18 17:58:02.951697', '2025-11-18 17:58:02.951697');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1270, 115, 1001276, 1, 17, 'Squeaky Boots', 'Mr. Krabs gives SpongeBob a pair of "special" boots because he bought them for Pearl, but she didn''t want them. SpongeBob loves them, but the squeaking drives Mr. Krabs crazy.', 11, '/7RxhWJPDRhbu7GES50CZZbuZKOS.jpg', '1999-09-04', '2025-11-18 17:58:02.951698', '2025-11-18 17:58:02.951698');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1271, 115, 1001277, 1, 18, 'Nature Pants', 'SpongeBob wants to give up his current life to live with the jellyfish against the wishes of all his friends. But, SpongeBob learns that a jellyfish life is not an easy one.', 11, '/8pyJbx7r6QRpq9cl2bSNx6GESW1.jpg', '1999-09-11', '2025-11-18 17:58:02.951699', '2025-11-18 17:58:02.951699');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1272, 115, 1001278, 1, 19, 'Opposite Day', 'Squidward gets so mad at SpongeBob and Patrick, he decides to sell his house. Squidward needs to get rid of his annoying neighbors so he can sell his house. He tells SpongeBob and Patrick that it is "Opposite Day." Squid hopes that they will act the opposite of what they usually are, annoying. Of course, it doesn''t work out as planned.', 11, '/1jK5rlE9Wqo7LyqTpCJgnJntc7W.jpg', '1999-09-11', '2025-11-18 17:58:02.9517', '2025-11-18 17:58:02.9517');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1273, 115, 1001279, 1, 20, 'Culture Shock', 'A talent show is taking place at the Krusty Krab to get more customers and more money, and Squidward is in charge. He will do anything to prevent SpongeBob from doing participating in it.', 11, '/nJezCReeGmHMsehtlXROM4Q2ZJ8.jpg', '1999-09-18', '2025-11-18 17:58:02.951701', '2025-11-18 17:58:02.951701');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1274, 115, 1001280, 1, 21, 'F.U.N.', 'SpongeBob thinks that Plankton is evil only because he is lonely and has no friends. SpongeBob becomes Plankton''s friend and plays with him. But, Mr. Krabs is convinced that Plankton is evil and that SpongeBob should not be hanging around with him.', 11, '/3HbNDhs7bVXHuCc8kvn96eH1suI.jpg', '1999-09-18', '2025-11-18 17:58:02.951702', '2025-11-18 17:58:02.951702');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1275, 115, 1001281, 1, 22, 'MuscleBob BuffPants', 'SpongeBob thinks he can get more attention if he becomes physically fit. But he soon finds that exercise is hard work, and orders "anchor arms," which he inflates with air, and looks buff. Everyone finds out how fake he is when Sandy signs him up for the annual anchor toss competition at Muscle Beach.', 11, '/AvNQkQECAOza2WEUDksxexnKujh.jpg', '1999-09-25', '2025-11-18 17:58:02.951702', '2025-11-18 17:58:02.951703');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1276, 115, 1001282, 1, 23, 'Squidward the Unfriendly Ghost', 'SpongeBob thinks he accidentally killed Squidward, so Squidward decides to use it for his advantage. Threatening to haunt them for the rest of their lives, Squidward makes SpongeBob and Patrick his servants.', 11, '/ckP0Z1Op7tHnMNsSKFA5Q1YNIlg.jpg', '1999-09-25', '2025-11-18 17:58:02.951703', '2025-11-18 17:58:02.951704');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1377, 115, 1026287, 4, 7, 'Selling Out', 'Mr. Krabs sells the Krusty Krab to a conglomerate that plans to turn it into a big corporate chain.', 11, '/i3uLRNJH5XItkoVjXSxe3rIOMDz.jpg', '2005-09-23', '2025-11-18 17:58:02.951797', '2025-11-18 17:58:02.951798');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1277, 115, 1001283, 1, 24, 'The Chaperone', 'SpongeBob takes Pearl to the prom because her previous prom date dumped her, and she is very emotional about it. SpongeBob and Pearl cause all kinds of mischief, and they eventually get thrown out of the prom.', 11, '/aAhf2Zduy1JGDZnmKAMonLD6wsZ.jpg', '1999-10-02', '2025-11-18 17:58:02.951705', '2025-11-18 17:58:02.951705');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1278, 115, 1001284, 1, 25, 'Employee of the Month', 'SpongeBob must try to uphold his position as "Employee of the Month," which he has won for 27 months in a row. But, when Squidward tells him the award is a scam, SpongeBob starts to tease Squidward by saying he could never be "Employee of the Month." Squidward challenges SpongeBob, and then make a mess of everything.', 11, '/w37jKZ63LqrqoNzD0BnxJ813y4w.jpg', '1999-10-02', '2025-11-18 17:58:02.951705', '2025-11-18 17:58:02.951706');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1279, 115, 1001285, 1, 26, 'Scaredy Pants', 'It''s Halloween and SpongeBob tries to scare some kids as "The Flying Dutchman," but the kids just laugh at his silly costume. SpongeBob gets Patrick to shave his head round, so he will look more like a ghost. He goes to the Krusty Krab to show off his costume, but everyone is more afraid of what is inside the costume.', 11, '/zWLpEU3QZ3ocvUeWUfzpdGll38t.jpg', '1999-10-28', '2025-11-18 17:58:02.951707', '2025-11-18 17:58:02.951707');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1280, 115, 1001286, 1, 27, 'I Was a Teenage Gary', 'Gary becomes sick when Squidward forgets to feed him, so a doctor has to come and give Gary some medicine. The doctor has Squidward give Gary the shot. Squidward accidentally gives the medicine to SpongeBob instead of Gary, which turns SpongeBob into a snail.', 11, '/7ze9VQHUNeODYdl9Cs26ujElQSw.jpg', '1999-10-28', '2025-11-18 17:58:02.951707', '2025-11-18 17:58:02.951708');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1281, 115, 1001287, 1, 28, 'SB-129', 'Squidward becomes frozen while hiding from SpongeBob and Patrick. He stays frozen for so long, he wakes up in the future. Once he''s in the future, he thinks he will be able to get away from SpongeBob and Patrick, but it seems where ever he goes, they are always there somehow.', 12, '/3wh4WkVecSwz2hHl3PNUcWKz61n.jpg', '1999-12-31', '2025-11-18 17:58:02.951708', '2025-11-18 17:58:02.951709');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1282, 115, 1001288, 1, 29, 'Karate Choppers', 'SpongeBob and Sandy just can''t stop practicing karate, even after Mr. Krabs warns SpongeBob that he will be fired. Soon Mr. Krabs finds them in the park using karate to make sandwiches, so he hires them both to make Krabby Patties at a super fast rate using Karate.', 11, '/mBPAUHbf09VxjswtWu7MRzDVcWM.jpg', '1999-12-31', '2025-11-18 17:58:02.951709', '2025-11-18 17:58:02.951709');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1283, 115, 1001289, 1, 30, 'Sleepy Time', 'SpongeBob leaves his dream in order to see what everyone else is dreaming about. But the other citizens of Bikini Bottom don''t appreciate this because in the process of his "Dream Exploring" he wakes everyone up and disturbs their sleep.', 11, '/djQBAgts7j2GxEorb2lBFR8qjJx.jpg', '2000-01-17', '2025-11-18 17:58:02.95171', '2025-11-18 17:58:02.95171');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1284, 115, 1001290, 1, 31, 'Suds', 'SpongeBob becomes sick after he leaves the door to the fridge open, and his house becomes icy. But when he gets ready to go to the doctor, Patrick scares him, and tries to cure SpongeBob himself.', 12, '/zx6G0ckG1U7Qqlvlk2NFL5kkABj.jpg', '2000-01-17', '2025-11-18 17:58:02.951711', '2025-11-18 17:58:02.951711');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1285, 115, 1001291, 1, 32, 'Valentine''s Day', 'SpongeBob wants to give Patrick the best Valentine''s Day gift ever, a chocolate heart shaped hot air balloon. Sandy starts to drive it over to SpongeBob and Patrick at the Valentine Day fair but, scallops attack the balloon, and SpongeBob must stall for time. Patrick goes crazy waiting for his gift, and starts to attack people at the fair.', 11, '/vaOEdnaQaidGwbm4Vr2R49yU4oh.jpg', '2000-02-14', '2025-11-18 17:58:02.951712', '2025-11-18 17:58:02.951713');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1286, 115, 1001292, 1, 33, 'The Paper', 'SpongeBob gets a small piece of paper from Squidward to play with. Squidward thinks that the paper is useless and just gives it away. SpongeBob soon does many fun things with it, and makes Squidward very jealous.', 11, '/ipoWhP8lJfB4ikZMTHu1uh4tO7J.jpg', '2000-02-14', '2025-11-18 17:58:02.951713', '2025-11-18 17:58:02.951714');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1287, 115, 1001293, 1, 34, 'Arrgh!', 'SpongeBob and Patrick play a pirate board game based on a real treasure map. Mr. Krabs joins in and wins a bunch of times in a row. The next day, Mr. Krabs takes the two boys on a treasure hunt, but they find out later that Mr. Krabs is using the game as a map, and is going crazy trying to find the Flying Dutchman''s treasure.', 11, '/sB5eP9VhSG0pupGOpNKKcUJu28O.jpg', '2000-03-15', '2025-11-18 17:58:02.951714', '2025-11-18 17:58:02.951715');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1288, 115, 1001294, 1, 35, 'Rock Bottom', 'SpongeBob and Patrick accidentally get on the wrong bus coming out of an amusement park called Glove World, and head for a city named Rock Bottom. When they get there, Patrick gets on a bus back to Bikini Bottom, and leaves SpongeBob by mistake. How will SpongeBob ever get home?', 11, '/lkwOlkbslxHeZDZHdcYjwKr1eUL.jpg', '2000-03-15', '2025-11-18 17:58:02.951715', '2025-11-18 17:58:02.951716');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1289, 115, 1001295, 1, 36, 'Texas', 'Sandy gets homesick, so SpongeBob and Patrick do as much as they can to cheer her up. When they want to throw her a surprise party and she won''t come, SpongeBob and Patrick make Sandy chase them to the Krusty Krab, where the party is being held.', 11, '/xuAEzTwx9ZqHW7en1JnGL4o3fIM.jpg', '2000-03-22', '2025-11-18 17:58:02.951716', '2025-11-18 17:58:02.951716');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1290, 115, 1001296, 1, 37, 'Walking Small', 'Plankton''s newest scheme involves getting someone to scare everyone away from "Goo Lagoon" so he can create his new restaurant, "The Mega Bucket." He tricks SpongeBob into scaring everyone away from the beach, until SpongeBob realizes what he is doing is wrong.', 11, '/rS0S0PD8FdQ1mNN1mmcAV5f4kCr.jpg', '2000-03-22', '2025-11-18 17:58:02.951717', '2025-11-18 17:58:02.951717');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1291, 115, 1001297, 1, 38, 'Fools in April', 'Squidward wakes up and finds out it is April Fools Day. April Fools Day is SpongeBob''s favorite holiday so Squidward becomes paranoid, thinking SpongeBob will play a joke on him. Squidward plays a mean trick on SpongeBob, but after SpongeBob runs home crying, Squidward must apologize.', 11, '/lcXAzpBXc8qsAFwA0PFV592mHbY.jpg', '2000-04-01', '2025-11-18 17:58:02.951718', '2025-11-18 17:58:02.951718');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1292, 115, 1001298, 1, 39, 'Neptune''s Spatula', 'SpongeBob and Patrick go to the Fry Cook Museum and are looking at the exhibits, when they come across the a spatula stuck in hardened grease. This spatula could only be pulled out by a fry cook worthy enough to cook for Neptune himself. SpongeBob pulls the spatula out with ease, and is excepted to move to Atlantis as Neptune''s fry cook! But, when Neptune tells SpongeBob he cannot bring his friends, SpongeBob starts to reconsider. Will SpongeBob leave his friends behind?', 11, '/1nD0XJQf4FggHvyg2hyynbZ2RHj.jpg', '2000-04-01', '2025-11-18 17:58:02.951719', '2025-11-18 17:58:02.951719');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1293, 115, 1001299, 1, 40, 'Hooky', 'Patrick introduces SpongeBob to a carnival but this "carnival" is really colored fishing hooks dropped by fishermen on land. Mr. Krabs warns SpongeBob to stay away and how dangerous they are, but Patrick keeps on talking about how fun they are. Who will SpongeBob listen to, Patrick or Mr. Krabs?', 11, '/1LpoWS3dNi6PmxRJl4h1eNcDxBq.jpg', '2000-04-08', '2025-11-18 17:58:02.951719', '2025-11-18 17:58:02.95172');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1294, 115, 1001300, 1, 41, 'Mermaid Man and Barnacle Boy II', 'SpongeBob is awarded a prize for his life size Krabby Patty sculptures of Mermaid Man and Barnacle Boy. The prize is the "Magic Conch" as seen in many episodes of the television show "The Adventures of Mermaid Man and Barnacle Boy." The conch shell, when blown, will make a noise and Mermaid Man and Barnacle Boy will come running! It is meant only for danger. SpongeBob blows the conch for simple chores. Will the heroes be so annoyed they must take back the conch?', 11, '/tnhc9z7KlyWlDSwNTz9UltzBRXR.jpg', '2000-04-08', '2025-11-18 17:58:02.95172', '2025-11-18 17:58:02.95172');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1295, 115, 1108183, 2, 1, 'Something Smells', 'SpongeBob eats a peanut onion sundae and acquires a hideous case of bad breath. And he can''t quite understand why everyone runs away from him whenever he talks to them.', 11, '/4KVxhBvscUIofo2OUH7Q9cKEl0o.jpg', '2000-10-26', '2025-11-18 17:58:02.951721', '2025-11-18 17:58:02.951721');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1296, 115, 1108184, 2, 2, 'Bossy Boots', 'When Pearl remodels the Krusty Krab into a hip local hangout, SpongeBob worries about the fate of the original restaurant (not to mention, his position as Fry Cook!).', 11, '/4LMNI3XNXopp3EciADuGa08M9YT.jpg', '2000-10-26', '2025-11-18 17:58:02.951722', '2025-11-18 17:58:02.951722');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1297, 115, 1108181, 2, 3, 'Your Shoe''s Untied', 'SpongeBob forgets how to tie his shoes, so he must re-learn how. But no one else knows how, either.', 11, '/1ivEl0jlfZJCKsU59geQ2B25Wd9.jpg', '2000-11-02', '2025-11-18 17:58:02.951723', '2025-11-18 17:58:02.951723');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1298, 115, 1108182, 2, 4, 'Squid''s Day Off', 'Squidward is put in charge of the Krusty Krab when Mr. Krabs goes to the hospital and decides to take the day off, but can''t help thinking SpongeBob will do something wrong.', 11, '/8eCzE9sfrFlGn25Bcz3U1BUwCDm.jpg', '2000-11-02', '2025-11-18 17:58:02.951723', '2025-11-18 17:58:02.951724');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1299, 115, 1108185, 2, 5, 'Big Pink Loser', 'Patrick realizes that he has never won any awards in his life, so he decides to copy everything that SpongeBob does. SpongeBob has won countless awards, so Patrick is sure that he will win one.', 11, '/4use8ohbmUwXb3sXgHtL5rsRdYz.jpg', '2000-11-16', '2025-11-18 17:58:02.951724', '2025-11-18 17:58:02.951725');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1300, 115, 1108186, 2, 6, 'Bubble Buddy', 'When no one will play with SpongeBob, he creates his own bubble buddy, but it causes many problems around town.', 11, '/21UFjY1zwsiJLuQ8xqdWWl97znt.jpg', '2000-11-16', '2025-11-18 17:58:02.951725', '2025-11-18 17:58:02.951726');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1301, 115, 1108187, 2, 7, 'Mermaid Man & Barnacle Boy III', 'Mermaid Man and Barnacle Boy decide to go on vacation, but unfortunately they don''t have anyone to look after the Merma-lair, so they ask SpongeBob and Patrick to look after it. However, they accidentally release Man Ray from a prison made of frozen tartar sauce.', 11, '/aNxZvIoaYg6lHfmLExAAuJiGj6N.jpg', '2000-11-27', '2025-11-18 17:58:02.951726', '2025-11-18 17:58:02.951727');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1302, 115, 1108188, 2, 8, 'Squirrel Jokes', 'SpongeBob tells jokes in a talent show at the Krusty Krab, but ends up saying jokes about squirrels, which makes Sandy mad.', 11, '/3NaBMNitp2U1vMzjMyBWnsdwTGe.jpg', '2000-11-27', '2025-11-18 17:58:02.951727', '2025-11-18 17:58:02.951728');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1303, 115, 1108214, 2, 9, 'Christmas Who?', 'SpongeBob brings Christmas to Bikini Bottom.', 22, '/sob6IljXbgHLIJQNN05aPkV3pPi.jpg', '2000-12-06', '2025-11-18 17:58:02.951728', '2025-11-18 17:58:02.951728');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1304, 115, 1108189, 2, 10, 'Dying for Pie', 'It''s employee brotherhood day and Squidward has nothing to give to SpongeBob, so he accidentally gives SpongeBob a pie bomb. Squidward spends the whole day with SpongeBob because SpongeBob only has one day to live.', 11, '/jJwlMuT8UnrXs2pflDxXxHClK1D.jpg', '2000-12-28', '2025-11-18 17:58:02.951729', '2025-11-18 17:58:02.95173');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1305, 115, 1108190, 2, 11, 'Imitation Krabs', 'In another attempt to steal the Krabby Patty formula, Plankton makes a robot that looks just like Mr. Krabs. But in order to get the formula, he will have to do some odd things as part of the "secret handshake."', 11, '/woltyP1XAt5tld5ewJgpS9nVJnL.jpg', '2000-12-28', '2025-11-18 17:58:02.95173', '2025-11-18 17:58:02.951731');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1306, 115, 1108191, 2, 12, 'Wormy', 'Sandy is going away and calls SpongeBob and Patrick to take care of her pets. One of them is a worm, and SpongeBob and Patrick have fun with it all day long, until the next day when it transforms into a butterfly and everybody in town gets scared of it.', 11, '/iQYgkLIMCsWJGlE4iVDvKv0hFhJ.jpg', '2001-02-17', '2025-11-18 17:58:02.951731', '2025-11-18 17:58:02.951732');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1307, 115, 1108192, 2, 13, 'Patty Hype', 'The Krusty Krab hasn''t had costumers in weeks, so SpongeBob comes up with an idea, but Mr. Krabs and Squidward laugh at the idea. So SpongeBob opens his own restaurant and becomes a huge success in Bikini Bottom.', 11, '/pJwoezIZP5To4KjYcxd2Mswo4FH.jpg', '2001-02-17', '2025-11-18 17:58:02.951732', '2025-11-18 17:58:02.951732');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1308, 115, 1108197, 2, 14, 'Survival of the Idiots', 'Despite Sandy''s warning, SpongeBob and Patrick sneak into her treedome, during a terrible snowstorm and since the doorknob is frozen, SpongeBob and Patrick realize they have to wait until spring. Will SpongeBob and Patrick be able to survive the entire winter? Or will Sandy, and the cold weather, stop them first?', 11, '/gNOlfrlTEOPHyiTaRK94lzhzoZF.jpg', '2001-03-05', '2025-11-18 17:58:02.951733', '2025-11-18 17:58:02.951733');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1309, 115, 1108198, 2, 15, 'Dumped', 'Suddenly, Gary seems to be hanging out with Patrick more than SpongeBob. SpongeBob thinks it''s because he loves Patrick more. But, what''s the real reason that Gary is attached to Patrick all of a sudden?', 11, '/on7XI0xxvYkmAdrkiJxzulgqqVZ.jpg', '2001-03-05', '2025-11-18 17:58:02.951733', '2025-11-18 17:58:02.951734');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1310, 115, 1108199, 2, 16, 'Grandma''s Kisses', 'SpongeBob asks his grandma not to kiss him because her public displays of affection are embarrassing.', 11, '/tSAd6bd70lXlqS9tngtKDiv2ssg.jpg', '2001-03-06', '2025-11-18 17:58:02.951735', '2025-11-18 17:58:02.951735');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1311, 115, 1108200, 2, 17, 'Squidville', 'Squidward is fed up with living next to Spongebob and Patrick, so he finds new neighbors who are more like himself.', 11, '/mjGi7vlJ61FkTEDgXcpsvyTnPVm.jpg', '2001-03-06', '2025-11-18 17:58:02.951736', '2025-11-18 17:58:02.951736');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1312, 115, 1108201, 2, 18, 'No Free Rides', 'To avoid another year with SpongeBob in her class, Mrs. Puff passes him with bogus extra credit and lets him have his license, but soon realizes that the consequences are beyond bad. When SpongeBob receives a new boat-mobile from his parents, Mrs. Puff attempts to steal it, and SpongeBob will stop at nothing to stop her.', 11, '/n5sFITxzxSyW2D2fgPOPLrpnKHm.jpg', '2001-03-07', '2025-11-18 17:58:02.951737', '2025-11-18 17:58:02.951738');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1313, 115, 1108202, 2, 19, 'I''m Your Biggest Fanatic', 'While at a jellyfishing fan convention, SpongeBob meets Kevin C. Cucumber, who gives him a chance to see if he can join his club, The Jellyspotters. However, SpongeBob is unaware that Kevin is only trying to make a fool out of him, but soon discovers the truth after the club attacks him with a robotic queen jellyfish.', 11, '/qbCLiPoLB8dDuSj0eTbmq6bKFqp.jpg', '2001-03-07', '2025-11-18 17:58:02.951738', '2025-11-18 17:58:02.951739');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1314, 115, 1108205, 2, 20, 'Pressure', 'Sandy and SpongeBob get into a fierce competition doing extreme underwater sports.', 11, '/im81RezurXqpltcv7cDs1JCnvq9.jpg', '2001-03-08', '2025-11-18 17:58:02.951739', '2025-11-18 17:58:02.951739');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1315, 115, 1108206, 2, 21, 'The Smoking Peanut', 'SpongeBob accidentally throws a peanut at Clamu the Oyster and then the police think that the one who threw the peanut was Patrick.', 11, '/5tLiyOcUxYsbtkXGpZRU0y9ycai.jpg', '2001-03-08', '2025-11-18 17:58:02.95174', '2025-11-18 17:58:02.951741');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1316, 115, 1108203, 2, 22, 'Shanghaied', 'When a giant anchor falls onto SpongeBob''s house, Squidward, SpongeBob and Patrick decide to climb the anchor, and they find the boat of the Flying Dutchman, who imprisons them.', 17, '/7BtVes5CR9bT8Z9rWsfUEfGNcqY.jpg', '2001-03-09', '2025-11-18 17:58:02.951741', '2025-11-18 17:58:02.951742');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1317, 115, 1108207, 2, 23, 'Prehibernation Week', 'Sandy is going wild over the fact that she will have to hibernate in a week.', 11, '/Yql6Cw8yxsHh7X2DtRtsUmFShV.jpg', '2001-05-05', '2025-11-18 17:58:02.951742', '2025-11-18 17:58:02.951743');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1318, 115, 1108208, 2, 24, 'Life of Crime', 'SpongeBob and Patrick find out that you can borrow anything without permission as long as you return it, or that''s what wise Mr. Krabs says. SpongeBob and Patrick want a balloon, but neither one has any money, so they "borrow" it and it pops. They decide to run away and live like criminals, because they think they''re now "thieves."', 11, '/bYr2CEsY1VNja5hl6G8ED78VQzv.jpg', '2001-05-05', '2025-11-18 17:58:02.951743', '2025-11-18 17:58:02.951744');
