INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1325, 115, 1952655, 2, 31, 'Just One Bite', 'When SpongeBob learns that Squidward has never actually tried a Krabby Patty, he becomes obsessed with the idea that Squidward must try it.', 11, '/vS09stZWhiP8Hr4nAQ5DakcgPS5.jpg', '2001-10-05', '2025-11-18 17:58:02.95175', '2025-11-18 17:58:02.95175');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1326, 115, 1952656, 2, 32, 'The Bully', 'At boating school, a new student shows up, but he says he''s gonna kick SpongeBob''s butt!', 11, '/mNwHjns0e8r6hCWtZVc4XkxNi72.jpg', '2001-10-05', '2025-11-18 17:58:02.95175', '2025-11-18 17:58:02.951751');
