INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1337, 115, 1026251, 3, 7, 'Nasty Patty', 'A health inspector shows up at the Krusty Krab, and while he is there, SpongeBob and Mr. Krabs see the news about a guy passing himself off as a health inspector to get free food.  Mr. Krabs is so mad he and SpongeBob make a Krabby Patty made with a bunch of nasty things. After it is served to the inspector he chokes on a fly and the two think he died from the patty. They later find out that he was a real health inspector, and that the other one was caught. Now, what will SpongeBob and Mr. Krabs do with the dead health inspector?', 11, '/jNlwXqJtqe1a2Pj3mlnypml3Y6r.jpg', '2002-03-01', '2025-11-18 17:58:02.95176', '2025-11-18 17:58:02.951761');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1338, 115, 1026252, 3, 8, 'Idiot Box', 'SpongeBob and Patrick buy a big screen TV, just so they can use the box using imagination, while Squidward refuses to believe that they are using their imagination inside the box on account of all the noise they are making.', 11, '/fVvye7ubaKoaWmWiMkAtEtIDILo.jpg', '2002-03-01', '2025-11-18 17:58:02.951761', '2025-11-18 17:58:02.951762');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1339, 115, 1026257, 3, 9, 'As Seen on TV', 'After SpongeBob has a small role in a commercial for the Krusty Krab, he thinks he is now famous.', 11, '/cKoTNvhwdjCOfio6EvoNle7sqtl.jpg', '2002-03-08', '2025-11-18 17:58:02.951763', '2025-11-18 17:58:02.951763');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1340, 115, 1026258, 3, 10, 'Can You Spare a Dime?', 'Squidward quits his job after Mr. Krabs accuses him of stealing the first dime he ever made, but Squidward has a hard time finding a new job.', 11, '/3ItfvNMq0CO6gbCPArhXCZQdzNE.jpg', '2002-03-08', '2025-11-18 17:58:02.951763', '2025-11-18 17:58:02.951764');
