INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1348, 115, 1026264, 3, 18, 'Krusty Krab Training Video', 'A training video for new employees of the Krusty Krab, which goes over the basics of being a good employee.', 11, '/AhEURr88ANCnMZISGJ6ewfQdDzn.jpg', '2002-05-10', '2025-11-18 17:58:02.951772', '2025-11-18 17:58:02.951773');
