INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1350, 115, 1026266, 3, 20, 'Chocolate with Nuts', 'SpongeBob and Patrick decide to become rich entrepreneurs by selling chocolate bars door to door.', 11, '/uGKoPrNWmJJkhIjWXeAO6Wuxal3.jpg', '2002-06-01', '2025-11-18 17:58:02.951775', '2025-11-18 17:58:02.951775');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1351, 115, 1026267, 3, 21, 'Mermaid Man and Barnacle Boy V', 'After being treated too much like a child by everyone, Barnacle Boy quits being a superhero and decides to be a supervillain.', 11, '/eCfEYuSvJkaeoq0aSy2NTIYS9DI.jpg', '2002-06-01', '2025-11-18 17:58:02.951776', '2025-11-18 17:58:02.951776');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1352, 115, 1026247, 3, 22, 'Club SpongeBob', 'SpongeBob and Patrick''s club is too small for Squidward... literally. But Squidward forces his way in, "propelling" the clubhouse into the middle of nowhere.', 11, '/2gn36trRovvNc0Mb9GvP1kMKtbc.jpg', '2002-07-12', '2025-11-18 17:58:02.951777', '2025-11-18 17:58:02.951777');
