INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1354, 115, 1952665, 3, 24, 'Graveyard Shift', 'SpongeBob and Squidward work the night shift.', 11, '/b9yIoM2c41gWIVXW4pEl7Hmg7Px.jpg', '2002-09-06', '2025-11-18 17:58:02.951778', '2025-11-18 17:58:02.951779');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1355, 115, 1952666, 3, 25, 'Krusty Love', 'Mr. Krabs falls in love with Mrs. Puff.', 11, '/iJ1jzVI1B8TQgFKu9njzDuGQyVm.jpg', '2002-09-06', '2025-11-18 17:58:02.951779', '2025-11-18 17:58:02.951779');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1356, 115, 1026268, 3, 26, 'New Student Starfish', 'Patrick gets bored everyday when SpongeBob goes to boating school, so SpongeBob insists that Patrick could join him. But what happens when Patrick makes SpongeBob lose a Noodle Student Star?', 11, '/wn0KPk7Cj8zVEo2jxT19mSKWITb.jpg', '2002-09-20', '2025-11-18 17:58:02.95178', '2025-11-18 17:58:02.95178');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1357, 115, 1026270, 3, 27, 'Clams', 'In celebration of Mr. Krabs'' one millionth dollar, he takes Squidward and SpongeBob on a fishing trip. After a giant clam snatches his precious dollar, Mr. Krabs tries to get it back.', 11, '/kuwN2U0MPYlGITa40uRT05Mevve.jpg', '2002-09-20', '2025-11-18 17:58:02.951781', '2025-11-18 17:58:02.951781');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1358, 115, 1026271, 3, 28, 'The Great Snail Race', 'When Squidward gets a purebred snail named Snelle, SpongeBob challenges him in the great snail race.', 11, '/7K4itBeJoRZ3u2ECCJBRyfZfuFg.jpg', '2003-01-24', '2025-11-18 17:58:02.951782', '2025-11-18 17:58:02.951782');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1359, 115, 1026272, 3, 29, 'Mid-Life Crustacean', 'When Mr. Krabs feels like an aging old man, he tries to feel young again, so he goes out with SpongeBob and Patrick for a night on the town.', 11, '/lObMaT4kZIbIKwQdBoq9EJw67cn.jpg', '2003-01-24', '2025-11-18 17:58:02.951782', '2025-11-18 17:58:02.951783');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1360, 115, 1172021, 3, 30, 'The Sponge Who Could Fly', 'SpongeBob tries his best to make an invention that allows him to fly. When all of them fail, people start to think that SpongeBob is crazy until he puts a hair dryer his pants. The hot air in his pants allows him to fly! But then, people start asking SpongeBob to do things for them, stopping him from flying with the jellyfish.', 22, '/gA8vT4acUbksVXD8x2akCpOYaLa.jpg', '2003-03-21', '2025-11-18 17:58:02.951783', '2025-11-18 17:58:02.951784');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1361, 115, 1952670, 3, 31, 'Gary Takes a Bath', 'The day that Gary has to take a bath arrives, but he doesn''t want to take one.', 7, '/q7jeatEVWopqR2tgi9rEoaxLhNm.jpg', '2003-07-26', '2025-11-18 17:58:02.951784', '2025-11-18 17:58:02.951785');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1362, 115, 1026273, 3, 32, 'Born Again Krabs', 'After Mr. Krabs eats a rotten Krabby Patty to save money, he ends up hospitalized for food poisoning and bargains with the Flying Dutchman for his soul, leading him to second-guess his cheap and miserly ways.', 11, '/ybsrd2zyrmchOWcY0T1F87o9xxQ.jpg', '2003-10-04', '2025-11-18 17:58:02.951785', '2025-11-18 17:58:02.951785');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1363, 115, 1026274, 3, 33, 'I Had an Accident', 'After SpongeBob shatters his buttocks in a sandboarding injury, he becomes paranoid of everything and confines himself to his own home with inanimate objects for friends.', 11, '/8r1CBPNUPu4ZNSaHVNHOfSUthDM.jpg', '2003-10-04', '2025-11-18 17:58:02.951786', '2025-11-18 17:58:02.951786');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1364, 115, 1026276, 3, 34, 'Missing Identity', 'While at a diner, SpongeBob tells the story of when he lost his name tag.', 11, '/wB4Re6nF6476vxbeUDEp9zGdy4Q.jpg', '2004-01-19', '2025-11-18 17:58:02.951786', '2025-11-18 17:58:02.951787');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1365, 115, 1026275, 3, 35, 'Plankton''s Army', 'It''s the 25th anniversary of Plankton''s first attempt to steal the Krabby Patty Secret Formula, and Plankton enlists his relatives to help him try again.', 11, '/wgQf9neRixZC57Wp2n17FB9QR4w.jpg', '2004-01-19', '2025-11-18 17:58:02.951787', '2025-11-18 17:58:02.951788');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1366, 115, 1026269, 3, 36, 'Ugh', 'SpongeBob, Patrick, and Squidward''s long ago ancestors, SpongeGar, Pattar, and Squagg, discover fire.', 22, '/xJH67zrPPBckpw0Xdoo3dmxc23K.jpg', '2004-03-05', '2025-11-18 17:58:02.951788', '2025-11-18 17:58:02.951789');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1367, 115, 1026277, 3, 37, 'Krabby Land', 'The first day of summer lures Mr. Krabs into making a children''s theme park, which doesn''t turn out the way he thinks it should.', 11, '/mkqeJtP8XhFwSbtlltdoexQfskB.jpg', '2004-04-03', '2025-11-18 17:58:02.951789', '2025-11-18 17:58:02.95179');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1368, 115, 1026278, 3, 38, 'The Camping Episode', 'SpongeBob and Patrick decide to go camping for the weekend, they camp out in the backyard. Squidward lures a sea bear to the campsite by doing stuff that would allure a sea bear.', 11, '/lJ8UvranKTkX3Yu4bejuV5G7lmj.jpg', '2004-04-03', '2025-11-18 17:58:02.95179', '2025-11-18 17:58:02.95179');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1369, 115, 1026279, 3, 39, 'SpongeBob Meets the Strangler', 'SpongeBob goes on his early litter patrol when he catches The Strangler. After he calls the police, The Strangler (disguised with a fake mustache) decides to be SpongeBob''s bodyguard. After three parties at SpongeBob''s house, The Strangler tries to strangle SpongeBob, but never gets the chance to be alone.', 11, '/7jbYwRxzXkiYKCf4BIWCMd43pjX.jpg', '2004-10-11', '2025-11-18 17:58:02.951791', '2025-11-18 17:58:02.951791');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1370, 115, 1026280, 3, 40, 'Pranks a Lot', 'SpongeBob and Patrick buy a prank called Invisible Spray. After taunting each other with the spray, they run out and decide to haunt Bikini Bottom while being invisible, preferably being ghosts. But with their last victim Mr. Krab, he washes them out with water and exposes them nude (they took their clothes off because the spray stains clothes) to the whole Krusty Krab, embarrassing them.', 11, '/sgCZg6uQtubooqQx9T9kRUJHUem.jpg', '2004-10-11', '2025-11-18 17:58:02.951792', '2025-11-18 17:58:02.951792');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1371, 115, 1026281, 4, 1, 'Fear of a Krabby Patty', 'Plankton unleashes a new plan; to get the Krusty Krab to work 24 hours. SpongeBob thinks this is a dream, until he thinks he is being chased by killer Krabby Patties.', 11, '/qG7DZVqiJHH56voCBnbJti3lOmI.jpg', '2005-05-06', '2025-11-18 17:58:02.951792', '2025-11-18 17:58:02.951793');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1372, 115, 1026282, 4, 2, 'Shell of a Man', 'Mr. Krabs is going to a naval reunion, but molts (leaves his shell) before he goes. He asks SpongeBob to go in his shell and imitate him for the reunion.', 11, '/pFeLa7biJKlkWa6QkrPfMIA3STo.jpg', '2005-05-06', '2025-11-18 17:58:02.951793', '2025-11-18 17:58:02.951793');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1373, 115, 1026283, 4, 3, 'The Lost Mattress', 'Mr. Krabs complains that his back hurts, so SpongeBob and Patrick buy a new mattress and Squidward tries to take credit for it. They give the new mattress to Mr. Krabs, but Mr. Krabs put his money in his old mattress, which SpongeBob, Patrick, and Squidward must find while Mr. Krabs is at the hospital.', 11, '/8usQNsBGL7YQqt04iKKuBWGAnhJ.jpg', '2005-05-13', '2025-11-18 17:58:02.951794', '2025-11-18 17:58:02.951794');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1374, 115, 1026284, 4, 4, 'Krabs vs. Plankton', 'Plankton tries to steal the formula, but slips and sues Mr. Krabs. Mr. Krabs hires a lawyer, but his lawyer slips and is hurt, so SpongeBob must try to help Mr. Krabs win the case by trying to open a briefcase that has something very important in it.', 11, '/vnVvgDdmxOgcMHtQ1khnMOmfVcV.jpg', '2005-05-13', '2025-11-18 17:58:02.951795', '2025-11-18 17:58:02.951795');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1375, 115, 1172912, 4, 5, 'Skill Crane', 'Mr. Krabs gets a new toy vender by the name of "Skill Crane." At first, Squidward doesn''t like it, but when Mr. Krabs lets him and SpongeBob give it a try, Squidward becomes obsessed with it. Can he win anything from the Skill Crane before it ruins his life?', 11, '/qkDdFBJak6BaOOSFFEG470h13kf.jpg', '2005-05-20', '2025-11-18 17:58:02.951796', '2025-11-18 17:58:02.951796');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1376, 115, 1026286, 4, 6, 'Good Neighbors', 'It''s Sunday and Squidward just wants to relax. But when SpongeBob and Patrick elect him as Good Neighbor President, they won''t leave him alone.', 11, '/odKZdANujm7rIl6Vvzx1NzSh8Hd.jpg', '2005-05-20', '2025-11-18 17:58:02.951797', '2025-11-18 17:58:02.951797');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1378, 115, 1026288, 4, 8, 'Funny Pants', 'Squidward fools SpongeBob into thinking that he has a laughter-related illness and convinces SpongeBob that if he laughs one more time in the next 24 hours, his laugh box could explode.', 11, '/mcwz91I9Ymttnd4c0D72ZBsuahS.jpg', '2005-09-30', '2025-11-18 17:58:02.951798', '2025-11-18 17:58:02.951799');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1379, 115, 1026290, 4, 9, 'Mermaid Man & Barnacle Boy VI - The Motion Picture', 'The adventures of Mermaid Man and Barnacle Boy are being told in a thrilling new motion picture. But after SpongeBob learns the heroes will be played by young actors, he sets out to make his own version of the movie using the real guys, fresh from their retirement home.', 11, '/9zvVv8vuJP9KBYB8QqSg7vVMmAw.jpg', '2005-10-07', '2025-11-18 17:58:02.951799', '2025-11-18 17:58:02.9518');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1380, 115, 1026289, 4, 10, 'Enemy In-Law', 'Mr. Krabs'' mom is dating again, and it seems like things could be serious. Krabs tries to be happy for his mother, but he is absolutely horrified when he learns that the secret paramour is his arch-rival Plankton! Convinced that this just another trick aimed at getting the family formula for Krabby Patties, Krabs tries to reveal Plankton''s schemes and break up the ill-favored fling.', 11, '/i8CHM7A1qgEyvJvD9Aw7rXQlnYd.jpg', '2005-10-14', '2025-11-18 17:58:02.9518', '2025-11-18 17:58:02.951801');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1381, 115, 1026291, 4, 11, 'Patrick SmartPants', 'After Patrick accidentally falls off a cliff while jellyfishing, he wakes up with superior intellect.', 11, '/uPooJ5BW5MGyjdPhItkoLzWLnUR.jpg', '2005-10-21', '2025-11-18 17:58:02.951801', '2025-11-18 17:58:02.951802');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1382, 115, 1026292, 4, 12, 'SquidBob TentaclePants', 'Sandy''s experimental teleportation device malfunctions, melding SpongeBob and Squidward into one body.', 11, '/uQwchWckhwgTiS6Gc7qdaFdA7Fc.jpg', '2005-11-04', '2025-11-18 17:58:02.951802', '2025-11-18 17:58:02.951803');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1383, 115, 1026285, 4, 13, 'Have You Seen This Snail?', 'While trying to beat a paddle-ball world record, SpongeBob forgets to feed Gary -- for 10 days. Gary runs away to downtown Bikini Bottom where he is taken in by a kindly old woman who confuses him with one of her many deceased pets. Once SpongeBob realizes that he has neglected Gary, he sets out in a town-wide search for him. Meanwhile, as Gary is wrapped in comfy blankets and indulged in an endless assortment of snacks, he discovers a very dark secret about this sweet old woman...', 22, '/r5i9dFUapLsqipEkGvSGWiCBMc9.jpg', '2005-11-11', '2025-11-18 17:58:02.951803', '2025-11-18 17:58:02.951803');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1384, 115, 1172916, 4, 14, 'Dunces and Dragons', 'After a freak jousting accident at a Medieval Times-style restaurant, SpongeBob and Patrick are transported to a medieval version of Bikini Bottom. There they are mistaken for great knights and sent on a quest by King Krabs to rescue his daughter, the Princess Pearl, from the clutches of the evil wizard Planktonamor.', 22, '/pGa2oV7Ni3KhBldS8EexGC0mCWH.jpg', '2006-02-20', '2025-11-18 17:58:02.951804', '2025-11-18 17:58:02.951804');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1385, 115, 1026293, 4, 15, 'Krusty Towers', 'After Mr. Krab''s gets a huge hotel bill he decides that he can make a profit from opening his own. When Patrick decides to visit the hotel Mr. Krabs demands Squidward to never deny a guest even the most ridiculous request, but after Patrick frustrates Squidward so badly he quits his job. Then he decides to check into the Krusty Towers.', 11, '/ApOpwowWLVW90qHRBSncnTbW3oI.jpg', '2006-04-01', '2025-11-18 17:58:02.951805', '2025-11-18 17:58:02.951805');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1386, 115, 1026294, 4, 16, 'Mrs. Puff, You''re Fired', 'Mrs. Puff gets fired from her boating school job due to her lack of passing Spongebob. Instead, a more-intense new instructor takes her place.', 11, '/8PMpd5aXiQ7XqZVfCAjpW2juhSm.jpg', '2006-04-01', '2025-11-18 17:58:02.951806', '2025-11-18 17:58:02.951806');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1387, 115, 1026296, 4, 17, 'Chimps Ahoy', 'The Chimpanzee beneficiaries of Sandy''s undersea treedome are paying a visit to see what progress she has made with her inventions. But Sandy doesn''t think any of her work will satisfy the chimps, and if they don''t like what she''s invented Sandy could lose her funding forcing her to leave Bikini Bottom. SpongeBob and Patrick decide to help their distraught friend by taking over her work and finishing her inventions.', 11, '/tYIiw7KHMNx7blNnGyOmNpA5rCs.jpg', '2006-05-05', '2025-11-18 17:58:02.951806', '2025-11-18 17:58:02.951807');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1388, 115, 1026295, 4, 18, 'Ghost Host', 'The Flying Dutchman takes up residence at SpongeBob''s house where he proceeds to scare, startle and surprise SpongeBob around the clock. Eventually all the spooky shenanigans grow old, and SpongeBob is no longer afraid of the Dutchman. This creates a panic for the old ghost who now fears that he has lost his scary touch. So SpongeBob decides to lend a hand and help the Flying Dutchman learn to scare people again.', 11, '/qZig4ipnvz34cuIdwlTYSvdQLR4.jpg', '2006-05-05', '2025-11-18 17:58:02.951807', '2025-11-18 17:58:02.951808');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1389, 115, 1026297, 4, 19, 'Whale of a Birthday', 'Mr. Krabs wants to give his daughter Pearl the best birthday ever. While he works on the party, SpongeBob is assigned the task of figuring out what Pearl would like for a present. So he trails her through the Bikini Bottom mall and takes note of everything she thinks is "Coral." Once Pearl arrives at her party she is horrified to find that her dad''s miserly ways have won out again. What was supposed to be the most fun and fabulous event ended up cheap and lame. It looks like Pearl''s birthday will go down in history as the worst one ever - until SpongeBob shows up with a truck-load of presents. Everything Pearl looked at in the mall was so Coral that SpongeBob bought it all - maxing out Mr. Krab''s credit card in the process.', 11, '/4GBHezc2oYQF5EH7t9UNGto9K4w.jpg', '2006-05-12', '2025-11-18 17:58:02.951808', '2025-11-18 17:58:02.951809');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1390, 115, 1026298, 4, 20, 'Karate Island', 'SpongeBob receives an invitation to take part in a competition on mysterious Karate Island for the chance to be crowned "King of Karate." SpongeBob and Sandy arrive at Karate Island and it turns out that it was just all a set-up to make SpongeBob buy real estate.', 11, '/hgvPKA2YTd9awamht39avlWmVYi.jpg', '2006-05-12', '2025-11-18 17:58:02.951809', '2025-11-18 17:58:02.95181');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1391, 115, 1026299, 4, 21, 'All That Glitters', 'When a customer orders the one thing that no one has ordered for years, the monster krabby patty, SpongeBob tries to lift it, but old Spat cracks in two. So he sells every single thing he owns (plus his clothes) for a new spatula, but the spatula refuses to flip a single patty, so SpongeBob tries to get his old spatula back. Will Spat forgive him? Will SpongeBob ever be dressed again?', 11, '/gV6ni4WH8u9SOty0xJVBmrdiDL2.jpg', '2006-06-02', '2025-11-18 17:58:02.95181', '2025-11-18 17:58:02.95181');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1392, 115, 1026300, 4, 22, 'Wishing You Well', 'Mr. Krabs makes SpongeBob go down the new wishing well after experiencing one for himself, and Patrick and Squidward accidentally join in. So, will they be able to get out and watch everybody''s wishes come true? Or will Mr. Krabs just make them stay down there when he enjoys the money?', 11, '/lPvUqBaH9hmiUIducznBBLGj5nZ.jpg', '2006-06-02', '2025-11-18 17:58:02.951811', '2025-11-18 17:58:02.951811');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1393, 115, 1026301, 4, 23, 'New Leaf', 'In the battle for fast food supremacy, Plankton has decided to throw in the towel and start a new business selling trinkets and souvenir gifts. He even renames his store from The Chum Bucket to The Chumporium. But Mr. Krabs doesn''t buy the change for a second. He''s determined to prove that this is nothing more than one of Plankton''s elaborate schemes aimed at stealing the Krabby Patty formula.', 11, '/cGAqWymx1Ar2xAudRzHpF8Ee93U.jpg', '2006-09-22', '2025-11-18 17:58:02.951812', '2025-11-18 17:58:02.951812');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1394, 115, 1026302, 4, 24, 'Once Bitten', 'Gary starts biting everyone in town, starting with Squidward. When Squid asks if Gary has been up-to-date on all of his snail shots, SpongeBob reveals that he''s never done any of that before. This only sends Squidward into a panic. Does he now have some rare snail-related disease? Is this the end for Squidward?', 11, '/frvtrGCRwZKVOWFur9TzWK3oCiG.jpg', '2006-09-29', '2025-11-18 17:58:02.951812', '2025-11-18 17:58:02.951813');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1424, 115, 1026318, 5, 14, 'Night Light', 'After SpongeBob reads a scary book before bedtime, he sees scary creatures in the dark.', 10, '/j7eD1EQJWfP8B6vXEJuPQpNRkM8.jpg', '2007-07-30', '2025-11-18 17:58:02.951837', '2025-11-18 17:58:02.951837');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1395, 115, 1026303, 4, 25, 'Squidtastic Voyage', 'While Squidward is playing the clarinet, he accidentally swallows the reed. SpongeBob and Patrick take a microscopic submarine to try to retrieve it from inside Squidward.', 11, '/jBIoIsPlgldAISIDJuJyXTSrGcn.jpg', '2006-10-06', '2025-11-18 17:58:02.951813', '2025-11-18 17:58:02.951814');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1396, 115, 1026304, 4, 26, 'Bummer Vacation', 'Mr. Krabs forces SpongeBob to take a vacation, but he doesn''t know how. Meanwhile, Patrick takes SpongeBob''s place as fry cook.', 11, '/72Z1FpFf5nFKjXd4kQchHGiwuKc.jpg', '2006-10-13', '2025-11-18 17:58:02.951814', '2025-11-18 17:58:02.951814');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1397, 115, 1026305, 4, 27, 'Best Day Ever', 'SpongeBob is going to have the best day ever. But when work, karate, jellyfishing and Squidward''s clarinet recital don''t go as planned will his day be ruined?', 11, '/cLnyLxeFpbNuPzJtaaFkukAHtWE.jpg', '2006-11-10', '2025-11-18 17:58:02.951815', '2025-11-18 17:58:02.951815');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1398, 115, 1026306, 4, 28, 'Wigstruck', 'SpongeBob finds an old-time wig and starts wearing it everywhere he goes.', 11, '/gcKri1lhiGC4K7hiNN8vaiWMVFJ.jpg', '2006-11-17', '2025-11-18 17:58:02.951816', '2025-11-18 17:58:02.951816');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1399, 115, 1026307, 4, 29, 'That''s No Lady', 'A misunderstanding over a vacation getaway advertisement causes Patrick to think he must "get out of town" or face dire consequences. SpongeBob can''t bear the thought of his best buddy moving away, so he decides to do what he can to hide Patrick''s identity from his "pursuers." After many failed attempts at disguises, they finally settle on the perfect one: Patrick is transformed into a girl, Patricia, to be exact. Patricia catches the eye of Mr. Krabs and soon she becomes the most charming waitress/waiter at the Krusty Krab.', 11, '/mWqftqLJIUABdKF1VPRwWaCrpfR.jpg', '2006-11-25', '2025-11-18 17:58:02.951816', '2025-11-18 17:58:02.951817');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1400, 115, 1026308, 4, 30, 'The Thing', 'After being covered in cement, the Bikini Bottomites are convinced that Squidward is an unknown species and SpongeBob tries to keep him as a pet.', 11, '/1mPjOkldLYy0SaPdVjEo7JKIhcQ.jpg', '2007-01-15', '2025-11-18 17:58:02.951817', '2025-11-18 17:58:02.951817');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1401, 115, 1026309, 4, 31, 'Hocus Pocus', 'SpongeBob tries out his new magic kit on Squidward and is convinced he''s turned his neighbor into an ice cream cone!', 11, '/logOqX8JrmMfSA07z7wVirmueWq.jpg', '2007-01-15', '2025-11-18 17:58:02.951818', '2025-11-18 17:58:02.951818');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1402, 115, 1026310, 4, 32, 'Driven to Tears', 'For the 58th time in a row, SpongeBob has failed his driving test, so Patrick takes a test and passes. But SpongeBob is angry that he did.', 11, '/xolxWP9IKL8ThWuJCqFGnFyy0xd.jpg', '2007-02-19', '2025-11-18 17:58:02.951818', '2025-11-18 17:58:02.951819');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1403, 115, 1026311, 4, 33, 'Rule of Dumb', 'Patrick''s ancestors were adlings, so Patrick is the legal king of Bikini Bottom and now he reigns/misrules Bikini Bottom.', 11, '/pzAXYQUerOp2MtxkS1LbZyF7epT.jpg', '2007-02-19', '2025-11-18 17:58:02.951819', '2025-11-18 17:58:02.95182');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1404, 115, 1026312, 4, 34, 'The Pink Purloiner', 'Patrick is jealous of SpongeBob''s jellyfish net. When SpongeBob finds out that it''s been stolen, he suspects Patrick is the culprit.', 11, '/s2oY4Jt5PtqwgXUGrzk2qmxAZHv.jpg', '2007-02-19', '2025-11-18 17:58:02.95182', '2025-11-18 17:58:02.95182');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1405, 115, 1026313, 4, 35, 'The Gift of Gum', 'It''s Best Friends Day, so Patrick and SpongeBob trade presents.', 11, '/nYEElkfUywbMBrQydhD5ZOWHCCi.jpg', '2007-02-19', '2025-11-18 17:58:02.951821', '2025-11-18 17:58:02.951822');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1406, 115, 1952677, 4, 36, 'Rise and Shine', 'Take a look inside Patrick Star''s rock, where we see that his morning routine is anything but ordinary.', 4, '/3clQ14uxAuVkOwVXWWzDidUaByt.jpg', '2007-02-19', '2025-11-18 17:58:02.951822', '2025-11-18 17:58:02.951822');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1407, 115, 1952678, 4, 37, 'Waiting', 'After SpongeBob discovers that his breakfast cereal has an offer for a free toy, he mails his requests. But now the hardest part is upon him: waiting for the toy to arrive.', 7, '/vOvigWYKalioICylTMbmZ8C5Z6n.jpg', '2007-02-19', '2025-11-18 17:58:02.951823', '2025-11-18 17:58:02.951823');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1408, 115, 1952679, 4, 38, 'Sing a Song of Patrick', 'After Patrick writes a song, SpongeBob helps him try to get it played on the radio.', 11, '/er20Vcv1Qnnead31jk5Lsk2vvgB.jpg', '2007-02-19', '2025-11-18 17:58:02.951824', '2025-11-18 17:58:02.951824');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1409, 115, 1172915, 4, 39, 'Born to Be Wild', 'When SpongeBob hears that a ferocious biker gang is coming to town, SpongeBob dons his leather jacket, warms up his bike, and prepares to protect the town all by himself.', 11, '/bUB2K6IGGJuZ2K8qKdZtiNauRIR.jpg', '2007-03-31', '2025-11-18 17:58:02.951825', '2025-11-18 17:58:02.951826');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1410, 115, 1172914, 4, 40, 'Best Frenemies', 'A new Kelp Smoothie chain is opening up all over Bikini Bottom. The chain''s smoothies are so delicious that soon everyone in town can be seen drinking one. But now that customers already have their smoothie, they don''t need to buy a beverage with their Krusty Krab order. This could hurt Mr. Krabs'' profits.', 11, '/gODmOsHuGMPmBj2kbvynMI33zi8.jpg', '2007-03-31', '2025-11-18 17:58:02.951826', '2025-11-18 17:58:02.951827');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1411, 115, 1026314, 5, 1, 'Friend or Foe', 'After yet another attack on the Krusty Krab by Plankton, SpongeBob asks Mr. Krabs why they hate each other so much. Mr. Krabs tells his side of the story in a series of flashbacks.', 23, '/o8FFLsFjEOMKTLh3KMWUTyjtqwi.jpg', '2007-04-13', '2025-11-18 17:58:02.951827', '2025-11-18 17:58:02.951828');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1412, 115, 1026322, 5, 2, 'Spy Buddies', 'Mr. Krabs enlists SpongeBob and Patrick to spy on Plankton.', 10, '/9iL9f75oKaPoiKibHF9ISw0JwIA.jpg', '2007-07-23', '2025-11-18 17:58:02.951828', '2025-11-18 17:58:02.951828');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1413, 115, 1026323, 5, 3, 'Boat Smarts', 'Mrs. Puff presents a film on good and bad boat drivers.', 4, '/aYzxMg8IyXlsMK2DRk5gm5ICg8s.jpg', '2007-07-23', '2025-11-18 17:58:02.951829', '2025-11-18 17:58:02.951829');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1414, 115, 1026324, 5, 4, 'Good Ol'' Whatshisname', 'Mr. Krabs organizes a work contest for SpongeBob and Squidward that involves naming all the customers at the Krusty Krab.', 7, '/7TuJ23Q6ksqyz2RFoBUXR81kMzJ.jpg', '2007-07-23', '2025-11-18 17:58:02.951829', '2025-11-18 17:58:02.95183');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1415, 115, 1026334, 5, 5, 'The Krusty Sponge', 'After a food critic raves about SpongeBob''s cooking, Mr. Krabs makes him the focal point of the Krusty Krab restaurant.', 10, '/gEQtTdVF3G5Zu3RLGGkL45ApfMe.jpg', '2007-07-24', '2025-11-18 17:58:02.95183', '2025-11-18 17:58:02.95183');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1416, 115, 1952680, 5, 6, 'Squid Wood', 'Rejected yet again by Squidward, SpongeBob decides that if he can''t hang with the real Squidward, he''ll make his own.', 10, '/lgsmJzUdJGAcifjN1PxhEUJp2J6.jpg', '2007-07-24', '2025-11-18 17:58:02.951831', '2025-11-18 17:58:02.951831');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1417, 115, 1026325, 5, 7, 'New Digs', 'After being late to work, SpongeBob decides to move into the Krusty Krab.', 10, '/w60PPexCNOtvpkJCLQuspDKQayt.jpg', '2007-07-25', '2025-11-18 17:58:02.951831', '2025-11-18 17:58:02.951832');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1418, 115, 1026326, 5, 8, 'Krabs à la Mode', 'Plankton turns down the Krusty Krab''s thermostat as part of another Krabby Patty stealing scheme, but it backfires on him when Mr. Krabs turns the Krusty Krab into a skating rink.', 11, '/o70VjmF3REIhxoXaeufWeUSp3AI.jpg', '2007-07-25', '2025-11-18 17:58:02.951832', '2025-11-18 17:58:02.951833');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1419, 115, 1026329, 5, 9, 'To Love a Patty', 'SpongeBob falls in love with a Krabby Patty.', 10, '/oZjBkPd2SJvoHCma3FEsDKvieGz.jpg', '2007-07-26', '2025-11-18 17:58:02.951833', '2025-11-18 17:58:02.951834');
