INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1547, 115, 1026431, 8, 2, 'Oral Report', 'While preparing to give an oral report for boating school, SpongeBob comes down with stage fright. SpongeBob asks Sandy for help, and receives a pair of goggles that would enable him to see people in their undergarments, so he will not feel nervous. However, in his oral presentation, his goggles malfunction, which makes SpongeBob to panic and run out with a boatmobile. Beating the red light, it calls the attention of a police, who starts chasing after him.', 11, '/pE51gZDaO0KfEgNytjj9aoZ7rDc.jpg', '2011-03-26', '2025-11-18 17:58:02.951936', '2025-11-18 17:58:02.951936');
