INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1549, 115, 1026430, 8, 4, 'Squidward''s School for Grown Ups', 'When Patrick suddenly grows a beard, he decides it is time to act like a grown-up. He tags along with Squiward, who offers to teach him everything he knows about how to be mature, much to SpongeBob''s dismay.', 11, '/rM3lrXd2LN44DhMHhj6UKS5ZhHW.jpg', '2011-06-04', '2025-11-18 17:58:02.951937', '2025-11-18 17:58:02.951938');
