INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1551, 115, 1026426, 8, 6, 'The Hot Shot', 'SpongeBob gets driving lessons from the son of a legendary race-car driver, Tony Fast Jr.', 12, '/7R8XsHMYGmBP0oQiyF9IFRMSUyd.jpg', '2011-06-18', '2025-11-18 17:58:02.951939', '2025-11-18 17:58:02.951939');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1552, 115, 1026424, 8, 7, 'The Other Patty', 'Mr. Krabs and Plankton, his business rival and Chum Bucket owner, set out to find clues on why they have no customers. The enemies find a common enemy—a popular new restaurant—in which they must work together to steal the secret formula of its "Flabby Patty" burgers.', 12, '/u2NYinrmJigIWUo8dnuc04mgEP6.jpg', '2011-06-25', '2025-11-18 17:58:02.95194', '2025-11-18 17:58:02.95194');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1553, 115, 1026429, 8, 8, 'Frozen Face-Off', 'SpongeBob and the gang, including Patrick, Mr. Krabs, Squidward, Sandy Cheeks, Plankton and Karen, and Gary, participate in a sled worm race for one million dollars. However, just before the race begins, Plankton sneaks off to the Krusty Krab and uses a robot as his replacement in the race. Plankton goes inside the Krusty Krab to steal the Krabby Patty formula, while the group must keep a yeti, who is attacking them, away.', 22, '/vpaa5lV7igPzNlV9yfhzaTIkE0z.jpg', '2011-07-15', '2025-11-18 17:58:02.95194', '2025-11-18 17:58:02.951941');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1554, 115, 1026423, 8, 9, 'Accidents Will Happen', 'When Squidward gets hurt on the job, he menaces to take legal action unless his employer, Mr. Krabs, agrees to cater to him to his every need. Mr. Krabs, who eventually gets tired of doing everything for Squidward, hires SpongeBob and Patrick to investigate the scene.', 12, '/bXXZWmNIvrgjlQIKyR1ZMJXlnNA.jpg', '2011-07-18', '2025-11-18 17:58:02.951941', '2025-11-18 17:58:02.951941');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1555, 115, 1026425, 8, 10, 'Drive Thru', 'Instead of paying money to repair a hole in the wall of the Krusty Krab, Mr. Krabs decides to use it to gain more income by turning it into a drive-thru window. However, his two employees, SpongeBob and Squidward, have difficulty in keeping up with orders, which results to wreak havoc.', 12, '/4BorH8Y7rKd2QIR6kiJ2FTGAQSU.jpg', '2011-07-19', '2025-11-18 17:58:02.951942', '2025-11-18 17:58:02.951942');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1556, 115, 1026432, 8, 11, 'Sweet and Sour Squid', 'Plankton tries to befriend Squidward in order to get the Krabby Patty secret formula. However, Squidward refuses to discourse with him until SpongeBob tells Plankton that he must compliment Squidward''s music in order to strike up a friendship. The two become friends and share their music to all of Bikini Bottom.', 11, '/ppvffkDMdXu24qUkwHDOErAU4qx.jpg', '2011-07-20', '2025-11-18 17:58:02.951943', '2025-11-18 17:58:02.951943');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1557, 115, 1026433, 8, 12, 'The Googly Artiste', 'When doing arts and crafts with his best friend SpongeBob, Patrick is coveted by everyone in town after an art critic praises his artwork. He soon becomes a famous artist, which makes Squidward jealous. When he reaches an artist''s block, Patrick must find new inspirations for his next masterpiece.', 11, '/nXgDfTTfQfPawAqGIOxs5dVOMc.jpg', '2011-07-21', '2025-11-18 17:58:02.951943', '2025-11-18 17:58:02.951944');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1558, 115, 1026442, 8, 13, 'Barnacle Face', 'The night before a school dance, Pearl gets a barnacle on her face. Mr. Krabs asks SpongeBob to help his daughter remove the blemish to save money, instead of taking Pearl to expensive treatment.', 11, '/ujOZG8iAqqvwKfGdv8UEKulOjfZ.jpg', '2011-09-16', '2025-11-18 17:58:02.951944', '2025-11-18 17:58:02.951944');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1559, 115, 1026443, 8, 14, 'Pet Sitter Pat', 'When SpongeBob gets an invitation to his Grandma''s birthday party, he asks his best friend Patrick to pet-sit Gary. However, Patrick only causes trouble, which makes SpongeBob angry.', 11, '/rz9zbjgqHYwRbB9eq2pwyDPvnsa.jpg', '2011-09-16', '2025-11-18 17:58:02.951945', '2025-11-18 17:58:02.951945');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1560, 115, 1026440, 8, 15, 'Mermaid Man Begins', 'SpongeBob and Patrick learn the secret origins of Mermaid Man and Barnacle Boy from the heroes themselves.', 11, '/7iJbkxcVldfJRE8j93JIhZ7j9Kp.jpg', '2011-09-23', '2025-11-18 17:58:02.951945', '2025-11-18 17:58:02.951946');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1561, 115, 1026441, 8, 16, 'Plankton''s Good Eye', 'Plankton grows himself another eye because he lacks depth perception. However, it changes his personality and causes him to be nice, because the eye is from SpongeBob''s DNA.', 11, '/vnx9pJgBj5dD3gLneZ3OXbDMf71.jpg', '2011-09-23', '2025-11-18 17:58:02.951946', '2025-11-18 17:58:02.951947');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1645, 115, 1026496, 10, 1, 'Mimic Madness', 'SpongeBob learns that imitation is the sincerest form of flattery.', 11, '/6OHHtCKWexvgOxSX28oFn4Zqs8I.jpg', '2017-02-25', '2025-11-18 17:58:02.952007', '2025-11-18 17:58:02.952007');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1562, 115, 1026444, 8, 17, 'House Sittin'' for Sandy', 'SpongeBob gladly accepts to house sit Sandy''s Treedome, while she is away. Sandy first shows SpongeBob what he should do, and all is quiet until Patrick arrives for a visit. The best friend causes chaos and wreak havoc, which results to the house getting destroyed.', 11, '/wOLc4BQvsCDd0pxycM8ShpDPjBh.jpg', '2011-09-30', '2025-11-18 17:58:02.951947', '2025-11-18 17:58:02.951948');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1563, 115, 1026445, 8, 18, 'Smoothe Jazz at Bikini Bottom', 'Squidward and SpongeBob win backstage passes and tickets to Kelpy G''s live concert. However, Patrick eats their passes shortly after the concert begins. Losing their passes, SpongeBob and Squidward try to sneak backstage to meet Kelpy G.', 11, '/4ow9v5jhv6p7wSWARGO5p3tDsIa.jpg', '2011-09-30', '2025-11-18 17:58:02.951948', '2025-11-18 17:58:02.951948');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1564, 115, 1026439, 8, 19, 'Ghoul Fools', 'SpongeBob and Patrick find a houseboat haunted by a crew of ghost pirates headed by Lord Poltergeist. The two get caught in a feud between them and the Flying Dutchman.', 22, '/l8gm5BvLOTrEmEZn1G7HJovRwUI.jpg', '2011-10-21', '2025-11-18 17:58:02.951949', '2025-11-18 17:58:02.951949');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1565, 115, 1026436, 8, 20, 'Walking the Plankton', 'Mr. Krabs and SpongeBob win free tickets to a cruise, thanks to Plankton, but they do not know that it is a secret plan to steal the Krabby Patty formula. At the same time, Plankton tricks his computer wife Karen for a vacation, and she is initially excited until when she realizes that this is part of his plan to steal the formula. He lies to her and the both hop on the same cruise as Mr. Krabs and SpongeBob.', 11, '/usk6zMciKl9e9UV7HYjNadIKSrd.jpg', '2011-11-07', '2025-11-18 17:58:02.951949', '2025-11-18 17:58:02.95195');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1566, 115, 1026435, 8, 21, 'Patrick''s Staycation', 'When feeling that he is doing the same activities every day, Patrick moans that he needs a break. SpongeBob suggests a vacation out of town, which cheers him. When at a travel agency, Patrick is given options, but they are thrown out when it is revealed that he cannot afford a trip. SpongeBob comes up with a solution—a "staycation", a vacation at home—which delights Patrick.', 11, '/kuui9ovJsub929jo6JSUzKbnkaJ.jpg', '2011-11-08', '2025-11-18 17:58:02.95195', '2025-11-18 17:58:02.95195');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1567, 115, 1026438, 8, 22, 'Mr. Krabs Takes a Vacation', 'Mr. Krabs takes a vacation with SpongeBob and Pearl to the Bikini Bottom Mint. However, his daughter does not want to tag along, so she stays at a museum. SpongeBob and Mr. Krabs proceed inside the mint, but the tour guide is instantly annoyed by their antics. When two bank robbers seize the mint, SpongeBob and Mr. Krabs stop them and they are rewarded with a special edition one-dollar bill with their faces on it, but Pearl confiscates the dollars and spends them on a new pair of shoes, causing Mr. Krabs to blast endless tear beams in the mint.', 11, '/e0bNR7Iaxyde6MJCrmzNI4FOPel.jpg', '2011-11-09', '2025-11-18 17:58:02.951951', '2025-11-18 17:58:02.951951');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1568, 115, 1026437, 8, 23, 'Mooncation', 'SpongeBob meets Sandy, who is preparing her rocket to go to the Moon for a vacation. However, SpongeBob accidentally stows away, and when on the Moon, the two set out camp. SpongeBob and Sandy play sports including sandboarding on its craters. After accidentally crashing the sandboard into the fuel tank, they immediately start the rocket because they need to return home before the fuel runs out.', 11, '/v426PeejCOBLeOdreBX0lT4t1hC.jpg', '2011-11-10', '2025-11-18 17:58:02.951952', '2025-11-18 17:58:02.951952');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1569, 115, 1026434, 8, 24, 'A SquarePants Family Vacation', 'SpongeBob invites Mr. Krabs, Pearl, Sandy, Mrs. Puff, Larry, Squidward, and Plankton to watch a slideshow of his family vacation to the Great Barrier Reef. In the slideshow, SpongeBob and his parents are on a family road trip with Patrick, but the two best friends get lost and end up in a forest for adventure.', 22, '/q3Z9lEgJAAw4EKf2Dzmu48WFIr1.jpg', '2011-11-11', '2025-11-18 17:58:02.951952', '2025-11-18 17:58:02.951953');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1570, 115, 1026448, 8, 25, 'The Krabby Patty That Ate Bikini Bottom', 'While looking for spare change, Mr. Krabs notices an over-sized soybean at Sandy''s Treedome. Mr. Krabs is interested in what could have enlarged the plant, and Sandy revealed an experimental growth formula, which Mr. Krabs steals out of sight. At the Krusty Krab, he uses the growth formula on a Krabby Patty, but it keeps on growing until chaos erupts.', 11, '/1Xh2rCthCoAnQY25SbzCqgfjm1i.jpg', '2011-11-25', '2025-11-18 17:58:02.951954', '2025-11-18 17:58:02.951954');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1571, 115, 1218409, 8, 26, 'Bubble Buddy Returns', 'SpongeBob receives a letter from an old friend Bubble Buddy, asking to babysit his son Shiny, who causes mischievous antics. SpongeBob must keep Shiny out of trouble and away from sharp and pointy edges.', 11, '/t8bTKQ9PAd3ZLZ57ZajaUr34wug.jpg', '2011-11-25', '2025-11-18 17:58:02.951955', '2025-11-18 17:58:02.951955');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1572, 115, 1026447, 8, 27, 'The Way of the Sponge', 'Sandy introduces Fuzzy Acorns, "the greatest karate master ever", to SpongeBob. The master is training Sandy to earn the "blacker belt", the highest belt in karate. SpongeBob wishes he had a belt, which Fuzzy overhears and tells SpongeBob that if he wants one, he has to earn it. Fuzzy offers to train SpongeBob so that he can earn the belt, which he reluctantly accepts.', 11, '/7GaziBuMT0MR6Ly39EwFYzqeYLm.jpg', '2011-11-26', '2025-11-18 17:58:02.951955', '2025-11-18 17:58:02.951956');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1573, 115, 1026446, 8, 28, 'Bubble Troubles', 'After making bubbles with hot sauce, SpongeBob and Patrick accidentally destroy Sandy''s air supply by causing a fire and fill her Treedome with water by contaminating it. They must help her find enough oxygen in order to help them breath. In the end, SpongeBob goes to the surface to create a giant air-filled bubble, and puts it into the Treedome.', 11, '/qCB5gYNpN8KYbtF20tpYyE21RaG.jpg', '2011-11-26', '2025-11-18 17:58:02.951956', '2025-11-18 17:58:02.951956');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1574, 115, 1218412, 8, 29, 'Are You Happy Now?', 'Squidward tries to find his happiest memory, but gives up after hope is lost. Desperately, SpongeBob "helps" him create one.', 11, '/eIxhKSDfJplBR0hhU0CShwowfN2.jpg', '2012-03-31', '2025-11-18 17:58:02.951957', '2025-11-18 17:58:02.951957');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1575, 115, 1218414, 8, 30, 'Planet of the Jellyfish', 'SpongeBob and Sandy battle an evil Jellyfish overlord, who is replacing everyone in town with clones. After searching for clues, they figure out that its weakness is mayonnaise.', 11, '/z2Pg13AD5FJ9HTKm0Mg80oEiq2r.jpg', '2012-03-31', '2025-11-18 17:58:02.951957', '2025-11-18 17:58:02.951958');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1576, 115, 1218410, 8, 31, 'Restraining SpongeBob', 'A fed-up Squidward has had it with SpongeBob''s annoying antics, pranks, wisecracks, and practical jokes and issues SpongeBob a restraining order against his neighbor. SpongeBob is afraid that he will violate the restraining order again. (According to this restraining order, SpongeBob is not allowed to come within 15 feet of Squidward, lest he end up going to jail for the rest of his life.)', 11, '/ffKkgT1REA1kSXWSmaOTA7l0wF5.jpg', '2012-04-02', '2025-11-18 17:58:02.951958', '2025-11-18 17:58:02.951958');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1577, 115, 1218420, 8, 32, 'Glove World R.I.P.', 'SpongeBob and Patrick spend a final day at Glove World before it shuts down forever, only for a new amusement park called Glove Universe to open.', 11, '/6P53FSv7tXrpAddsaqOCpF75Qoz.jpg', '2012-04-03', '2025-11-18 17:58:02.951959', '2025-11-18 17:58:02.951959');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1578, 115, 1218416, 8, 33, 'Home Sweet Rubble', 'SpongeBob''s pineapple house is falling apart and is in needing repairs, so he gets all of his friends to help him refurbish it. However, despite the big changes, SpongeBob is not happy with it. In the end, his pet snail Gary helps him with his can, which contains a fully furnished pineapple.', 11, '/oLQckIVxUQTgYfAfReyqpEl2UeT.jpg', '2012-04-04', '2025-11-18 17:58:02.95196', '2025-11-18 17:58:02.95196');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1579, 115, 1218411, 8, 34, 'Fiasco!', 'Squidward discovers a piece of art by an artist named "Fiasco", and Mr. Krabs decides to use it as an attraction to his customers at the Krusty Krab. But soon after, Plankton steals it, believing he can reverse engineer the Krabby Patty formula from it.', 11, '/uVlOlTc4kd9aXgIQSHvW5BloKKy.jpg', '2012-04-05', '2025-11-18 17:58:02.95196', '2025-11-18 17:58:02.951961');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1681, 115, 1392273, 11, 17, 'Pat the Horse', 'Patrick wants to be a horse.', 11, '/dSsWCPLXAMWRVB1xOdQww9JoulI.jpg', '2017-12-02', '2025-11-18 17:58:02.952033', '2025-11-18 17:58:02.952034');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1580, 115, 1218415, 8, 35, 'Free Samples', 'Plotting to ruin Mr. Krabs, Plankton, his business rival, drives away his customers. As a result, Mr. Krabs is forced to give out free Krabby Patties in order to try to win them back.', 11, '/imVWBYVXVJhOzgc7o1BIpy6DVzU.jpg', '2012-04-06', '2025-11-18 17:58:02.951961', '2025-11-18 17:58:02.951961');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1581, 115, 1218418, 8, 36, 'InSPONGEiac', 'SpongeBob has difficulty falling asleep, while Patrick struggles to stay awake.', 11, '/vEIWCPta5iYLDF4LAz4t4tZtGji.jpg', '2012-04-09', '2025-11-18 17:58:02.951962', '2025-11-18 17:58:02.951962');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1582, 115, 1218423, 8, 37, 'Treats!', 'SpongeBob brings home a box of new snail treats that Gary will do anything to get – especially when they run out.', 11, '/a8t8KmNVSGMttVF7UUxzJEq2kYU.jpg', '2012-04-10', '2025-11-18 17:58:02.951962', '2025-11-18 17:58:02.951963');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1583, 115, 1218421, 8, 38, 'Squiditis', 'When Squidward goes home sick with a fake illness, SpongeBob thinks he has caught it for real.', 11, '/2Xx83YvRzf5rURVKOO1KzvwHlLG.jpg', '2012-04-11', '2025-11-18 17:58:02.951963', '2025-11-18 17:58:02.951963');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1584, 115, 1218424, 8, 39, 'For Here or to Go', 'Mr. Krabs organizes a guessing game to his customers at the Krusty Krab for a Krabby Patty. When Plankton tries it, he actually wins. Mr. Krabs will do anything to stop him from collecting his prize.', 11, '/dXcRR1LTpaYMwdYLXXz5VIl2l9Y.jpg', '2012-04-12', '2025-11-18 17:58:02.951964', '2025-11-18 17:58:02.951964');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1585, 115, 1218417, 8, 40, 'Karen 2.0', 'When Plankton replaces his computer wife Karen with an upgrade called Karen 2.0, the original Karen leaves and gets a job at the Krusty Krab.', 11, '/h5shrGg76Q7vZ4O8ugyZK2cyl1a.jpg', '2012-04-13', '2025-11-18 17:58:02.951964', '2025-11-18 17:58:02.951965');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1586, 115, 1953575, 8, 41, 'Extreme Spots', 'When the drasticals come to town, SpongeBob and Patrick try to do whatever it takes to join them, no matter how extreme – or dangerous. Whether attempting sand motorbiking, hang gliding, seashell surfing or extreme bubble blowing, SpongeBob and Patrick undertake the challenge in an effort to demonstrate they are extreme.', 11, '/pQAhElHiRPaG0t8rOi1DrpFu6n4.jpg', '2012-07-21', '2025-11-18 17:58:02.951965', '2025-11-18 17:58:02.951966');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1587, 115, 1953576, 8, 42, 'Squirrel Record', 'Sandy is determined to break a record number of world records, in record time, so SpongeBob joins her for an action-packed weekend of dangerous record setting.', 11, '/8Cwxy9qtEozJEUQBX2UNmBUEYUh.jpg', '2012-07-21', '2025-11-18 17:58:02.951966', '2025-11-18 17:58:02.951966');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1588, 115, 1218422, 8, 43, 'Demolition Doofus', 'Mrs. Puff enters SpongeBob into a demolition derby, but SpongeBob''s awful driving makes him a superstar.', 11, '/koArya99eI9AcgTJh2XNNyR9zsx.jpg', '2012-07-21', '2025-11-18 17:58:02.951967', '2025-11-18 17:58:02.951967');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1589, 115, 1218419, 8, 44, 'Face Freeze!', 'SpongeBob and Patrick get face freeze after making too many faces despite being warned not to by Mr. Krabs.', 11, '/rxsnXs8AfRsauQoowe5FJmyVzol.jpg', '2012-07-21', '2025-11-18 17:58:02.951967', '2025-11-18 17:58:02.951968');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1590, 115, 1218428, 8, 45, 'The Good Krabby Name', 'Mr. Krabs wants all of Bikini Bottom to eat at the Krusty Krab, so SpongeBob and Patrick go on an advertising blitz.', 11, '/8iSDSjk8TnNDNlB8SYa1uAt6bAh.jpg', '2012-09-03', '2025-11-18 17:58:02.951968', '2025-11-18 17:58:02.951968');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1591, 115, 1953578, 8, 46, 'Squid Baby', 'A head injury makes Squidward think he''s a baby, and SpongeBob and Patrick must look after him.', 11, '/nsBKwZW6nzQB87VlAyhPm6WeKsc.jpg', '2012-09-03', '2025-11-18 17:58:02.951969', '2025-11-18 17:58:02.951969');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1592, 115, 1953579, 8, 47, 'License to Milkshake', 'SpongeBob returns to the Milkshake Academy after discovering his milkshake license has expired.', 11, '/33ev5bnuVDUHDafLfDseC2HjWqv.jpg', '2012-09-07', '2025-11-18 17:58:02.951969', '2025-11-18 17:58:02.95197');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1593, 115, 1218430, 8, 48, 'Hello Bikini Bottom!', 'A concert promoter named Colonel Carper wants SpongeBob and Squidward to form a band together and send them on a "world tour". However, the greedy Mr. Krabs decides to manage them in order to make his own profits from his to employees'' success.', 22, '/1OSvZ7zsJgwQgCVJbSy8FtDD3gM.jpg', '2012-10-08', '2025-11-18 17:58:02.95197', '2025-11-18 17:58:02.95197');
INSERT INTO public.episodes (id, title_id, tmdb_episode_id, season_number, episode_number, episode_name, overview, runtime, thumbnail_path, air_date, created_at, updated_at) VALUES (1594, 115, 1218426, 8, 49, 'Super Evil Aquatic Villain Team Up Is Go!', 'Plankton teams up with Man Ray to get the Krabby Patty formula and rule the world.', 11, '/mI9BSFeVBY3klL06cPDjkiWiJGK.jpg', '2012-10-14', '2025-11-18 17:58:02.951971', '2025-11-18 17:58:02.951971');
